INSERT INTO `ensiklopedia_data` (`data_id`, `kategori`, `nama`, `jenis`, `deskripsi`, `kandungan`, `manfaat`, `klasifikasi`, `sub_klasifikasi`, `video`, `created_at`, `updated_at`, `is_active`, `cek`) VALUES
('05-01-20185a4f30c71d8bd', 'buah', 'Alpukat', 'Alpukat (Persea americana)', 'Alpukat berasal dari Amerika dan Meksiko.\r\nAlpukat merupakan buah lokal. Buah ini digolongkan sebagai buah sejati tunggal berdaging. Kulit luar buah berwarna hijau dan daging buah berwarna kuning kehijauan (Hermanto, 2013). Dari empat kecamatan yang dijadikan sampel, buah alpukat ditemukan di Kecamatan Kaliwates, Balung, Ambulu, dan Tanggul. ', 'kilojoule : 1347 kj\r\nkalori : 322 kkal.\r\nlemak : 29,47 g.\r\nprotein : 4,02 g.\r\nkarbohidrat : 17,15 g.\r\nsodium : 14 mg.\r\nkalium : 975 mg.', 'Mengurangi risiko kanker.\r\nSenyawa lain yang ada di dalam alpukat adalah\r\nkarotenoid. Ini adalah senyawa\r\nAntioksidan yang mungkin memiliki\r\nkemampuan sebagai antikanker.\r\nBaik untuk penderita osteoarthtritis.\r\nBerguna untuk mencegah osteoporosis.\r\nMenurunkan kolesterol jahat.\r\nBaik untuk menjaga berat badan dan kesehatan\r\njantung.\r\nKebaikan alpukat untuk kesehatan jantung juga\r\nmungkin signifikan.\r\nBaik bagi kesehatan janin.\r\nBagus untuk mata.\r\nMengurangi stres.', 'kindom : Plantae\r\ndivisi:Magnoliophyta\r\nkelas : Magnoliopsida\r\nordo : Laurales\r\nfamili : Lauraceae\r\ngenus : Persea\r\nspesies : Persea americana', '', NULL, '2019-10-03 09:54:37', '2019-09-07 18:42:22', 1, 1),
('05-01-20185a4f30c76ca70', 'buah', 'Anggur Hitam', 'Anggur Hitam (Vitis vinifera)', 'Anggur berasal dari Armenia, tetapi budidaya anggur sudah dikembangkan di Timur \r\nTengah sejak 4000 SM.\r\nAnggur hitam merupakan buah lokal.Buah ini digolongkan sebagai buah sejati tunggal berdaging. Kulit luar buah berwarna ungu dan daging buah berwarna ungu bening (Wirakusumah, 2007). Dari empat kecamatan yang dijadikan sampel, buah anggur hitam ditemukan di Kecamatan Tanggul, Ambulu dan Balung. ', 'kilojoule : 13 kj\r\nkalori : 3 kkal.\r\nlemak : 0,01 g.\r\nprotein : 0,04 g.\r\nkarbohidrat : 0,9 g.\r\nkalium : 10 mg.', 'Mengantur gula darah.\r\nMeningkatkan fungsi otak.\r\nMelindungi jantung.\r\nMeningkatkan penglihatan.\r\nMencegah kanker.\r\nMembuat  rambut sehat.\r\nMeningkatkan daya tahan tubuh.\r\nMenjaga kesehatan tulang.\r\nMenjaga berat badan.\r\nMenyehatkan kulit.  ', 'kindom : Plantae\r\ndivisi:-\r\nkelas : Magnoliopsida\r\nordo : Rhamnales\r\nfamili : Vitaceae\r\ngenus : Vitis\r\nspesies : Vitis vinifera', '', NULL, '2019-10-03 09:55:26', '2019-09-07 18:42:22', 1, 1),
('05-01-20185a4f3128e6600', 'sayur', 'Buncis', 'Buncis (Phaseolus vulgaris Linn)', 'Tanaman buncis ini berasal dari Amerika.\r\nBuncis (Phaseolus vulgaris) termasuk jenis sayuran polong semusim (berumur pendek). polong buncis memiliki bentuk bervariasi ada yang berbentuk pipih dan lebar yang panjangnya lebih dari 20 cm, bulat lurus dan pendek kurang dari 12 cm. Serta berbentuk silindris agak panjang sekitar 12-30 cm. Polong buncis memiliki struktur halus, tekstrus renyah, ada yang berserat, dan ada yang tidak berserat. Bentuk polongnya ada yang pipih dan ada yang gilig. Jumlah biji dalam satu polong bervariasi antara 5-14 buah, tergantung pada panjang polong. Kulitnya berwarna hijau muda dengan biji yang berwarna hijau yang dilapisi kulit sedikit tebal berwarna putih', 'kilojoule : 130  kj.\r\nkalori : 31 kkal.\r\nlemak : 0,12 g.\r\nprotein : 1,82 g.\r\nkarbohidrat : 7,13 g.\r\nsodium : 6 mg.\r\nkalium : 209 mg.', 'Buncis (Phaseolus vulgaris L), sebagai salah satu tanaman yang mengandung fitosterol, berkhasiat meluruhkan kencing (diuretik) dan menurunkan kadar glukosa darah (hipoglikemik).', 'kindom : Plantae\r\ndivisi:Magnoliophyta\r\nkelas : Magnoliopsida\r\nordo : Fabales\r\nfamili : Fabaceae\r\ngenus : Phaseolus\r\nspesies : Phaseolus vulgaris Linn', '', NULL, '2019-10-03 10:34:42', '2019-09-07 18:42:22', 1, 1),
('05-01-20185a4f316c57848', 'sayur', 'Cabai Besar ', 'Cabai Besar (Capsicum annum L.)', 'Tanaman cabai ini berasal dari Amerika Tropis.\r\nBuah cabai besar panjang dengan ujungnya runcing, panjangnya sekitar 9-12 cm. Warna cabai besar berwarna hijau waktu masih muda dan berwarna merah pada waktu tua. Kulit cabai besar berwarna merah dengan biji yang berwarna putih kekuningan. Bentuk cabai besar seperti cabai rawit akan tetapi ukurannya lebih besar dari cabai rawit ', 'kilojoule : 1331  kj.\r\nKalori 318 kkal. Lemak 17,27 g.  Lemak Jenuh 3,26 g. Lemak tak Jenuh\r\nGanda 8,37 g. Lemak tak Jenuh Tungga l2,75 g.  Protein 12,01 g.\r\nKarbohidrat 56,63 g. Serat 27,2 g. Gula 10,34 g. Sodium 30 mg. Kalium 2014 mg. ', 'Dalam pabrik obat-obatan, cabai yang mempunyai heat unit tinggi digunakan untuk bahan koyo. Akan tetapi, bagi penderita wasir (haemorrhoid) atau ambien, sakit mata, sakit tenggorokan, radang kandungan, dan bagi wanita yang menyusui lebih baik jangn makan cabai karena dapat mengakibatkan hal-hal yang kurang baik ', 'kindom : Plantae\r\ndivisi:Spermatophyta\r\nkelas :  Dicotylodenae\r\nordo :  Solanales\r\nfamili : Solanaceae\r\ngenus : Capsicum \r\nspesies : Capsicum annum L. Var. abreviatum Fingerhuth', 'sub_kindom : Tracheobionta\r\n', NULL, '2019-10-03 10:35:32', '2019-09-07 18:42:22', 1, 1),
('05-01-20185a4f31a5ad860', 'buah', 'Belimbing (Averrhoa carambola L.)', 'Belimbing (Averrhoa carambola L.)', 'Belimbing merupakan tanaman buah berupa pohon yang berasal dari kawasan \r\nMalaysia, kemudian menyebar luas ke berbagai negara yang beriklim tropis lainnya di dunia\r\ntermasuk Indonesia.\r\nBelimbing merupakan buah lokal. Buah ini digolongkan sebagai buah sejati tunggal berdaging. Kulit luar buah berwarna kuning dan daging buah juga berwarna kuning (Hermanto, 2013). Dari empat kecamatan yang dijadikan sampel, belimbing ditemuakan di Kecamatan Tanggul, Kaliwates, Ambulu dan Balung.     ', 'kilojoule : 117 kj\r\nkalori : 28 kkal.\r\nlemak : 0,3 g.\r\nprotein : 0,95 g.\r\nkarbohidrat : 6,12 g.\r\nsodium : 2 mg.\r\nkalium : 121 mg.\r\n', 'Menyehatkan pencernaan.\r\nPencegahan kanker.\r\nKaya antioksidan.\r\nMeningkatkan kerja enzim.\r\nMengatasi  tekanan darah tinggi.\r\nMengatasi gangguan ginjal.\r\nMengurangi kadar kolesterol jahat.\r\nBelimbing memberikan nutrisi lain yang baik\r\nuntuk rambut.\r\nMakan buah belimbing atau menggunakan\r\nbelimbing langsung pada kulit berjerawat.\r\n', 'kindom : Plantae\r\ndivisi:Magnoliopsyta\r\nkelas : Magnoliopsida\r\nordo : Geraniales\r\nfamili : genus\r\ngenus : Averrhoa \r\nspesies : Averrhoa carambola L.', '', NULL, '2019-10-03 09:56:08', '2019-09-07 18:42:22', 1, 1),
('05-01-20185a4f3260ef9d8', 'buah', 'Buah Naga Merah', 'Buah Naga Merah (Hylocereus polyhizus)', 'Buah naga atau di Inggris disebut dengan Pitaya merupakan buah yang berasal dari \r\nNegara Eropa, yaitu Meksiko, Amerika Tengah dan Amerika Selatan.Buah ini saat ini sudah banyak\r\ndibudidayakan di negara-negara Asian seperti Taiwan, Vietnam, Filipina, Malaysia dan\r\nIndonesia.\r\nBuah naga merah merupakan buah lokal. Buah ini digolongkan sebagaibuah sejati tunggal berdaging. Kulit luar buah berwarna merah dan daging buah juga berwarna merah (Hermanto, 2013). Dari empat kecamatan yang dijadikan sampel, buah naga merah ditemuakan di Kecamatan Tanggul, Kaliwates, Ambulu, dan Balung. ', 'protein : 1,1 g.\r\nair : 87 g.\r\nlemak : 0,4 .\r\nkarbohidrat : 11,0 g.\r\nvitamin B1 : 0,04 g.\r\nserat : 0,04 mg.\r\nvitamin B2 : 0,05 mg.\r\nvitamin B3 : 0,16 mg.\r\nkalsium : 8,5 mg.\r\nvitamin C : 20,5 mg.\r\nbesi : 0,16 mg.\r\n', 'Membantu menjaga kesehatan dan stamina\r\ntubuh.\r\nMembantu menurunkan kadar kolesterol dalam\r\ntubuh.\r\nMembantu dalam penyembuhan penyakit kanker.\r\nMeredakan penyakit asma.\r\nMenstabilkan tekanan darah.\r\nMencegah osteoporosis.\r\nMembantu penyembuhan penyakit diabetes.\r\nMembantu merawat kesehatan mata.\r\nMembantu mengurangi berat badan.\r\nMembantu melancarkan pencernaan.', 'kindom : Plantae\r\ndivisi:Spermatophyta \r\nkelas : Dicotyledonae\r\nordo : Cactales\r\nfamili : Cactaceae\r\ngenus : Hylocereus\r\nspesies : Hylocereus undatus', '', NULL, '2019-10-02 14:30:58', '2019-09-07 18:42:22', 1, 1),
('05-01-20185a4f3283e80c0', 'sayur', 'Cabai rawit', 'Cabai rawit (Capsicum frustescenns L)', 'Tanaman cabai ini berasal dari Amerika Tropis\r\nCabai rawit termasuk kedalam sayuran Solanaceae, bisa ditanam baik didataran rendah maupun di dataran tinggi. Cabai rawit buahnya kecil, pendek, dan panjangnya sekitar 2-3 cm, warnanya ada yang berwarna hijau ketika muda sedangkan yang tua berwarna merah. Kulit buah cabai berwarna merah dengan biji yang berwarna putih kekuningan, biji satu dengan yang lainnya sejajar dan menumpuk.', 'kilojoule : 1331 kj. Kalori 318 kkal. Lemak 17,27 g.  Lemak Jenuh 3,26 g. Lemak tak Jenuh\r\nGanda 8,37 g. Lemak tak Jenuh Tunggal 2,75 g. Kolesterol 0 mg. Protein 12,01 g.\r\nKarbohidrat 56,63 g. Serat 27,2 g . Gula 10,34 g. Sodium 30 mg. Kalium 2014 mg .', 'Dalam pabrik obat-obatan, cabai digunakan untuk bahan koyo. Cabai juga bermanfaat untuk mengobati infeksi, mengatasi nyeri pada sendi, menjaga kekebalan tubuh dan dapat meningkatkan nafsu makan', 'kindom :  Plantae\r\ndivisi:Magnoliophyta\r\nkelas : Magnoliopsida\r\nordo : Solanales\r\nfamili : Solanaceae\r\ngenus : Capsicum L\r\nspesies : Capsicum frustescenns L.', 'sub_kindom : Tracheobionta\r\nsub_divisi : Spermatophyta\r\nsub_kelas : Asteridae\r\n', NULL, '2019-10-03 10:28:29', '2019-09-07 18:42:22', 1, 1),
('05-01-20185a4f32b1c393e', 'buah', 'Buah Naga (Hylocereus undatus)', 'Buah Naga Putih ', 'Buah naga atau di Inggris disebut dengan Pitaya merupakan buah yang berasal dari \r\nNegara Eropa, yaitu Meksiko, Amerika Tengah dan Amerika Selatan.\r\nBuah naga putih merupakan buah lokal. Buah ini digolongkan sebagaibuah sejati tunggal berdaging. Kulit luar buah berwarna merah dan daging buah juga berwarna putih. (Hermanto, 2013). Dari empat kecamatan yang dijadikan sampel, buah naga putih  ditemuakan di Kecamatan Tanggul..', 'Kadar gula yang terdapat pada buah naga putih sekitar 13-18 brik.\r\nSedangkan kandungan mineral yang di miliki oleh buah naga putih yaitu sekitar 90,20 %.\r\nKandungan karbohidrat dalam buah naga putih mengandung sebanyak 11,5 g.\r\nBuah naga putih memiliki jumlah protein sekitar 0,53 g.\r\nKandungan asam dalam buah naga putih sekitar 0,139 g.\r\nSedangkan serat yang terdapat pada buah naga putih yaitu sekitar 0,71 g.\r\nKandungan fosfornya sekitar 8,7 mg.\r\nMagnesium yang terdapat pada buah naga mencapai 60,4 mg.\r\nSedangkan kandungan kalsium dalam buah naga putih mencapai 134,5 mg.\r\nKandungan vitamin C yang terdapat pada buah naga putih yaitu sekitar 9,4 mg.\r\n\r\n', 'Menurunkan kadar gula darah.\r\nMenurunkan kolesterol.\r\nMencegah tumor dan kanker.\r\nMemelihara kesehatan mata.\r\nMemelihara kesehatan mulut.\r\nMemelihara kesehatan jantung.\r\nMelancarkan pencernaan.\r\nMenghindarkan ibu hamil dari pendarahan.\r\nMenghindarkan ibu hamil dari anemia.\r\nMenjaga kesehatan tulang dan gigi.\r\nMeningkatkan daya tahan tubuh.\r\nMencegah penuaan dini.', 'kindom : Plantae\r\ndivisi:Spermatophyta\r\nkelas : Dicotyledonae\r\nordo : Cactales\r\nfamili : Cactaceae\r\ngenus : Hylocereus\r\nspesies : Hylocereus undatus', '', NULL, '2019-10-02 14:35:23', '2019-09-07 18:42:22', 1, 1),
('05-01-20185a4f32d175682', 'buah', 'Blewah', 'Blewah (Cucumis melo)', 'Blewah berasal dari Afrika selatan kemudian menyebar dan menetap di China,dan\r\nkarena bangsa Eropa sangat menyukai buah Blewah maka penyebaran Blewah turut campur\r\ntangan bangsa Eropa yang gemar melaut dan menyebarkan blewah hingga tiba di Indonesia.\r\n\r\nBlewah merupakan buah lokal. Buah ini digolongkan sebagai buah sejati tunggal berdaging. Kulit luar buah berwarna kuning kehijauan dan daging buah juga berwarna orange (Hermanto, 2013). Dari empat kecamatan yang dijadikan sampel, blewah ditemukan di Kecamatan Ambulu.', 'kilojoule : 142 kj\r\nkalaori : 34 kkal.\r\nlemak : 0,19 g.\r\nprotein : 0,84 g.\r\nkarbohidrat : 8,16 g.\r\nsodium : 16 mg.\r\nkalium : 267 mg.', 'Membantu mencegah kanker.\r\nMenjaga kesehatan mata.\r\nMeningkatkan sistem kekebalan tubuh.\r\nMempercepat proses penyembuhan luka.\r\nMenguatkan tulang.\r\nMelancarkan proses diet.\r\nPengganti makanan berat.\r\nMeringankan menstruasi.\r\nMembuat kulit tampak lebih segar.\r\nMeredakan stres.\r\nMenjaga kesehatan kardiovaskular.', 'kindom : Plantae\r\ndivisi:Magnoliophyta\r\nkelas : Magnoliopsida\r\nordo : Violales\r\nfamili : Cucurbitaceae\r\ngenus : Cucumis\r\nspesies : Cucumis melo var. cantalupensis', '', NULL, '2019-10-03 09:57:13', '2019-09-07 18:42:22', 1, 1),
('05-01-20185a4f32dd2118d', 'sayur', 'Gude/ Kacang Iris ', 'Gude/ Kacang Iris (Cajanus cajan L.)', 'Gude ditemukan di ditemukan di Afrika.\r\nGude/ kacang iris termasuk dalam sayuran Leguminose, dapat tumbuh disemua jenis tanah kecuali tanah gambut. Buah gude berbentuk polong agak pipih seperti kapri panjangnya sekitar 2-4 cm, , setiap polongnya terdapat 4-8 biji. Buah gude tertutupi kulit yang berwarna hijau dengan bulu halus dan polongnya berwarna hijau dengan biji yang bermacam-macam warna yaitu hijau, merah, keunguan serta hijau keunguan.', 'energi 336 kkal. \r\nprotein 20,7 g. \r\nkarbohidrat 62 gram. \r\nlemak 1,4 gram.\r\nkalsium 125 miligram. \r\nfosfor 275 miligram. \r\ndan zat besi 4 miligram. \r\nvitamin A sebanyak 150 IU. \r\nvitamin B1 0,48 miligram .\r\nvitamin C 5 miligram. ', 'Khasiat tanaman gude, selain sebagai sumber protein nabati, daunnya biasa digunakan sebagai pereda penyakit gatal pada kulit dan bijinya berfungsi sebagai anti kanker ', 'kindom : Plantae\r\ndivisi:Magnoliophyta\r\nkelas : Magnoliopsida\r\nordo :  Fabales\r\nfamili : Fabaceae\r\ngenus : Cajanus\r\nspesies : Cajanus cajan L.', 'sub_kindom : Tracheobionta\r\nsub_divisi : Spermatophyta\r\nsub_kelas : Rosidae\r\n', NULL, '2019-10-03 10:28:52', '2019-09-07 18:42:22', 1, 1),
('05-01-20185a4f3317022ab', 'sayur', 'Kacang panjang', 'Kacang panjang (Vigna unguiculata)', 'Kacang Panjang berasal dari daerah tropis Asia (India dan china) dan Afrika (Abbisinia dan Ethiopia).\r\nKacang panjang termasuk dalam tanaman sayur Leguminosae. Kacang panjang dapat ditanam setiap saat baik di dataran rendah maupun tinggi. Buah kacang panjang berwarna hijau tua dan bentuknya bulat panjang, ramping, ukurannya sekitar 20-25 cm. Kulit buah berwarna hijau dengan biji yang terdapat didalamnya berwarna hijau kemerahan dengan dilapisi oleh kulit tipis yang berwarna kemerah-merahan. Daun kacang panjang atau yang biasa disebut Lembayung daunnya berwarna hijau tua dengan tulang daun yang berwarna putih kehijauan, warna tangkainya hijau muda .', 'kilojoule : 130 kj.\r\nKalori 31 kkal .\r\nLemak 0,12 g .\r\nLemak Jenuh 0,026 g .\r\nLemak tak Jenuh Ganda 0,059 g .\r\nLemak tak Jenuh Tunggal 0,005 g .\r\nProtein 1,82 g .\r\nKarbohidrat 7,13 g .\r\nSerat 3,4 g .\r\nGula 1,4 g. \r\nSodium 6 mg.\r\nKalium 209 mg.  ', 'Kacang panjang banyak mengandung zat gizi seperti protein dan vitamin A, vitamin B, dan vitamin C. Daun kacang panjang sangat baik bagi wanita yang menyusui karena dapat memperbanyak air susu ibu. Kacang panjang bersifat dwiguna, artinya sebagai sayuran polong penting dan penyubur tanah.', 'kindom : Plantae\r\ndivisi:Magnoliophyta\r\nkelas : Magnoliopsida\r\nordo : Fabales\r\nfamili : Fabaceae\r\ngenus : Vigna\r\nspesies : Vigna unguiculata', 'sub_famili : Faboideae\r\n', NULL, '2019-10-03 10:29:23', '2019-09-07 18:42:22', 1, 1),
('05-01-20185a4f3347507a7', 'buah', 'Jambu Biji Merah', 'Jambu (Psidium guajava L)', 'Jambu biji merupakan buah asli yang berasal dari Amerika.\r\nJambu biji merah merupakan buah lokal. Buah ini digolongkan sebagaibuah sejati tunggal berdaging. Kulit luar buah berwarna hijau dan daging buah berwarna merah (Hermanto, 2013). Dari empat kecamatan yang dijadikan sampel, jambu biji merah ditemuakan di Kecamatan Tanggul, Kaliwates, Ambulu, dan Balung.    ', 'kilojoule : 285 kj\r\nkalori : 68 kkal.\r\nlemak : 0,95 g.\r\nprotein : 2,55 g.\r\nkarbohidrat : 14,32 g.\r\nsodium : 2 mg.\r\nkalium : 417 mg.', 'Mencegah kanker.\r\nMelancarkan pencernaan.\r\nMenjaga fungsi saraf dan otak.\r\nMenangkal radikal bebas.\r\nMengendalikan tekanan darah.\r\nMenyehatkan kelenjar tiroid.\r\nMembantu menyerap nutrisi.\r\nMerelaksasi tubuh.\r\nBaik untuk ibu hamil.\r\nMerawat kulit wajah.\r\nMelindungi kulit dari UV.\r\nMencegah penuaan dini.\r\nSebagai toner kulit alami.\r\nMengatasi masalah kulit.', 'kindom : Plantae\r\ndivisi:Magnoliophyta\r\nkelas : Magnoliopsida\r\nordo : Myrtales\r\nfamili : Myrtaceae \r\ngenus : Psidium\r\nspesies : Psidium guajava', '', NULL, '2019-10-03 10:05:47', '2019-09-07 18:42:22', 1, 1),
('05-01-20185a4f338984ac2', 'sayur', 'Kedelai', 'Kedelai (Glycine max)', 'Asal usul kedelai, pertama kali ditemukan dalam buku Pen Ts’ao Kong Mu (Materica\r\nMedica) pada era Kekaisaran Sheng-Nung pada 2838 Sebelum Masehi (SM) (Anonim 2005).\r\nKedelai termasuk kedalam kelas Dicotylodenae yaitu tumbuhan berbiji berkeping dua. Polong merupakan bentuk buah dari tanaman kedelai. Polong kedelai berbulu dan berwarna hijau. Setiap buahnya terdapat sekitar 2-3 polong yang dilapisi oleh kulit tipis berwarna putih.', 'kilojoule : 1971 kj.\r\nKalori :471 kkal .\r\nLemak: 25,4 g .\r\nProtein: 35,22 g .\r\nKarbohidrat: 33,55 g .\r\nSodium :163 mg .\r\nKalium :1470 mg .', 'Kedelai  mempunyai nilai gizi cukup tinggi. Di antara jenis kacang-kacangan, kedelai merupakan sumber protein (35-45 %), lemak (18-32 %), karbohidrat (12-30 %), air (7 %), vitamin, mineral dan serat yang paling baik. Dalam lemak kedelai terkandung beberapa fosfolipida penting, yaitu lesitin, sepalin dan lipositol ', 'kindom : Plantae\r\ndivisi:Spermatophyta\r\nkelas : Dicotylodenae\r\nordo : Rosales\r\nfamili : Fabaceae\r\ngenus : Glycine\r\nspesies : Glycine max', '', NULL, '2019-10-03 10:30:29', '2019-09-07 18:42:22', 1, 1),
('05-01-20185a4f33df1f541', 'sayur', 'Kecipir ', 'Kecipir (Psophocarpus tetragonolobus L.)', 'Kecipir merupakan tumbuhan asli Indonesia yang berasal dari kawasan di Papua\r\n(Indonesia dan Papua Nugini) dan sekitarnya.\r\nBuah kecipir berbentuk polong persegi empat dengan panjang 15-40 cm. Setiap segi bersayap dan dibagain pinggirnya berombak, bergerigi dan berlekuk, lebar sayp 0,30-1cm, berwarna kuning hijau, hijau atau krem, dan berwarna lurik merah. Polong muda pada umumnya berwarna hijau, dan berubah menjadi cokelat atau hitam bila telah masak, polong berisi 5-20 biji. Bentuk biji agak membulat dengan panjang 0,60-1 cm dengan bobot biji 0,04 cm-0,64 gram, biji berwarna kehijauan ', 'kilojoule : 1771 kj.\r\nEnergi 409 kkal. \r\nKarbohidrat 41.7 gram, \r\nSerat Pangan 25.9 gram, \r\nLemak tak jenuh 2.3 gram , \r\nLemak tak jenuh tunggal 6 gram, \r\nLemak tak jenuh majemuk 4.3 gram,\r\nProtein 29.65 gram, \r\nVitamin A, Vitamin C, Vitamin E, Vitamin B1 .(Thiamin) 1.03 mg (79%), \r\nVitamin B2 (Riboflavin) 0.45 mg (30%),\r\nVitamin B3 (Niacin) 3.09 mg (21%),\r\nVitamin B5 (Asam Pantothenat) 0.795 mg (16%), Vitamin B6 0.175 mg (13%), \r\nVitamin B9\r\n(Folat) 45 fjg (11%), \r\nKalsium 440 mg (44%), \r\nFosfor 451 mg (64%), \r\nZat Besi 13.44 mg (108%), \r\nMagnesium 179 mg (48%), \r\nMangan 3.721 mg (186%), \r\nSeng 4.48 mg (45%), \r\nKalium 977 mg (21%),\r\nNatrium 38 mg (2%).', 'Polong kecipir merupakan sumber protein, karbohidrat, dan vitamin A. Kandungan nutrisi dalam kecipir adalah mineral penting, seperti kalsium, zink, sodium, potassium, magnesium, fosfor, dan besi. Kecipir mengandung asam behenat, yaitu asam lemak yang tidak diserap usus, sehingga tidk menyebabkan kegemukan, Kecipir juga mengandung zat antinutisi. Biji-biji kecipir dapat digunakan sebagai pencampuran ramuan jamu godok untuk penambah nafsu makan, pencegah masuk angin, mual dan pusing serta sebagai antiflu', 'kindom : Plantae\r\ndivisi:Spermatophyta\r\nkelas : Dicotylodenae\r\nordo : Fabales\r\nfamili : Papilionaceae\r\ngenus :  Psophocarpus\r\nspesies : Psophocarpus tetragonolobus L. ', 'sub_divisi : Angiospermae\r\n', NULL, '2019-10-03 10:29:54', '2019-09-07 18:42:22', 1, 1),
('05-01-20185a4f34489c17c', 'buah', 'Kedondong', 'Kedondong(Spondias dulcis)', 'Kedondong (Spondias dulcis Forst.) sendiri merupakan tanaman yang berasal dari\r\nkawasan Asia Tenggara dan Asia Selatan. Tanaman ini menyebar ke berbagai negara yang\r\nberiklim tropis. \r\nBuah kedondong  merupakan buah lokal. Buah ini digolongkan sebagaibuah sejati tunggal berdaging. Kulit luar buah berwarna hijau dan daging buah berwarna putih (Hermanto, 2013). Dari empat kecamatan yang dijadikan sampel, kedondong ditemuakan di Kecamatan Tanggul, Kaliwates, Ambulu dan Balung. ', 'kilojoule : 172 kj\r\nkalori : 41 kkal.\r\nlemak : 0,27 g.\r\nprotein : 0,88 g.\r\nkarbohidrat : 10 g.\r\nsodium : 3 mg.\r\nkalium : 250 mg.\r\n', 'Meringankan penyakit maag.\r\nMenyembuhkan disentri.\r\nMengatasi diare.\r\nObat penyakit\r\nSakit tenggorokan dan infeksi mulut.\r\nMengatasi kemandulan.\r\nMenyembuhkan radang telinga.\r\nMengatasi keracunan ikan.\r\nSelain sebagai obat batuk, kulit bagian dapan ini\r\ndapat juga digunakan sebagai obat saat demam.\r\nMeringankan sakit perut.\r\nMenjaga kesehatan pencernaan.\r\nMembantu menurunkan berat badan.\r\nSebagai antioksidan.\r\nMencegah penuaan dini.\r\nMengatasi diabetes dan kolesterol.\r\nMengobati borok, luka perih, dan luka bakar.', 'kindom : Plantae\r\ndivisi:Magnoliophyta\r\nkelas : Magnoliopsida\r\nordo : Sapindales\r\nfamili : genus\r\ngenus : Spondias\r\nspesies : Spondias dulcis', '', NULL, '2019-10-03 10:09:18', '2019-09-07 18:42:22', 1, 1),
('05-01-20185a4f34748e8be', 'sayur', 'Kondur/ Bligu', 'Kondur/ Bligu (Benincasa hispida)', 'Buah bligo berasal dari negara Indonesia dan Jepang, tetapi pada masa kini bisa\r\nditemukan di kebanyakan Negara tropis di Asia.\r\nKondur/ bligu termasuk kedalam kelas Magnoliopsida  dan termasuk ke dalam family Cucurbitaceae yaitu tanaman yang bersifat menjalar. Buah bligu berbentuk lonjong, berbulu halus dan tajam, berwarna hijau muda. Besar buahnya sekitar 3 kg/ buah. Dagingnya berwarna putih dan di dalamnya terdapat biji yang banyak dan berwarna putih kecokelatan', 'Bligu mengandung alkoloid kukurbitins, miosina, vitelin, minyak lemak, dan zat pati. ', 'Buah bligu dapat digunakan sebagai obat penderita demam dan penyakit tifus. Baik untuk anak-naka karena dapat menghilangkan lendir-lendir dalam tenggorokan ', 'kindom : Plantae\r\ndivisi:Magnoliophyta\r\nkelas : Magnoliopsida\r\nordo : Violales\r\nfamili : Cucurbitaceae\r\ngenus : Benincasa\r\nspesies : Benincasa hispida ', 'sub_kindom : Tracheobionta\r\nsub_divisi : Spermatophyta\r\nsub_kelas : Dilleniidae\r\n', NULL, '2019-10-02 22:37:00', '2019-09-07 18:42:22', 1, 1),
('05-01-20185a4f348d056fb', 'sayur', 'Kluwih ', 'Kluwih (Artocarpus camansi)', 'Tanaman keluwih tersebar di negara-negara tropis dan Pasifik.\r\nKluwih ini merupakan tanaman sayur Moraceae yang termasuk salah satu anggota tumbuhan berbunga. Sayuran ini bisa tumbuh ditanah yang subur (banyak humus) pada ketinggian tempat dataran rendah sampai 1.000 m dpl. Buah kluwih berwarna ijau muda, Buah besar, bulat dan berduri lunak dan pendek. Daging buah kluwih berwarna putih dan bagian kulitnya bergetah. Biji kluwih berwarna putih bersih yang dibalut oleh kulit yang berwarna kecokelatan ', 'Energi : 111 kkal. \r\nProtein : 1,5 g.\r\nKarbohidrat : 27,2 g. \r\nLemak : 0,3 g.\r\nKalsium : 28 mg.\r\nZat Besi : 1 mg. \r\nVitamin A : 20 IU. \r\nVitamin B1 : 0,1 mg.\r\nVitamin C : 19 mg. ', 'Biji kluwih memiliki keseimbangan nutrisi yang meliputi karbohidrat, lemak, protein, dan mineral  yang  baik bagi  tubuh. Biji  kluwih  mengandung  lemak  sebesar  5,599%, serat  sebesar 8,197 %, fenol  sebesar  0,061% dan karbohidrat sebesar  64,965 %. Kluwih mempunyai banyak sekali manfaat contohnya: mencegah gangguan kelenjar limfa, mengatasi gangguan cerna, mencegah penyakit jantung, menurunkan kadar kolesteros, mengandung vitamin C dan B, mengatasi gangguan pencernaan, menurunkan panas demam, menambah kadar zat besi, anti stress, mengaktifkan hormone, mencegah radang ', 'kindom : Plantae\r\ndivisi:Magnoliophyta\r\nkelas : Magnoliopsida\r\nordo :  Rosales\r\nfamili : Moraceae\r\ngenus : Artocarpus\r\nspesies : Artocarpus camansi', '', NULL, '2019-10-02 22:35:12', '2019-09-07 18:42:22', 1, 1),
('05-01-20185a4f34e6a90ac', 'sayur', 'Labu air/ labu cina', 'Labu air/ labu cina (Lagenaria siceraria)', 'Banyak ilmuan mengatakan bahwa tanaman labu air adalah asli dari Afrika dan hidup di daerah yang beriklim sedang dan tropis di Asia dan Amerika. (Sunarjono, 2016). Labu air/ labu cina termasuk kedalam sayuran Cucurbitaceae. Bentuk buahnya lonjong dengan ujung tumpul, warna kulit buahnya  berwarna hijau keputih-putihan. dengan warna dagingnya putih dan teksturnya empuk. Dalam buahnya terdapat Biji yang berwarna putih yang dilapisi oleh kulit biji yang berwarna putih kekuningan.', 'kilojoule : 109 kj.\r\nkalori : 26 kkal.\r\nlemak : 0,1 g.\r\nprotein : 1 g.\r\nkarbohidrat : 6,5 g.\r\nsodium : 1 mg.\r\nkalium : 340 mg.\r\n', 'Labu air banyak mengandung  lemak, serat, gula, karbohidrat, energi, protein, vitamin A, bkharoten, vitamin B1, B2, B3, B5, B6,B9, C, E, polifenol, saponin, seng, sodium, kalium, fosfor, magnesium, zat besi dan kalsium. Labu air mempunyai manfaat yaitu menurunkan berat badan, menyembuhkan sembelit, antibiotic, menambah kekebalan tubuh, menurunkan panas, tekanan darah tinggi dan diabetes', 'kindom : Plantae\r\ndivisi:Magnoliophyta\r\nkelas : Magnoliopsida\r\nordo : Cucurbitales\r\nfamili : Cucurbitaceae\r\ngenus : Lagenaria\r\nspesies : Lagenaria siceraria', '', NULL, '2019-10-03 10:32:44', '2019-09-07 18:42:22', 1, 1),
('05-01-20185a4f35471537e', 'sayur', 'Keratok', 'Keratok (Phaseolus lunatus)', 'Kratok berasal dari Benua Amerika. Keratok termasuk kedalam tanaman sayur Fabaceae. Warna kulit keratok berwarna hijau. Polong merupakan bentuk buah dari tanaman Keratok, setiap polongnya terdapat 3-4 biji yang dilapisi oleh kulit tipis yang berwarna hijau muda ', 'karbohidrat 54,5 –74,2%, protein 17,9-29%, dan serat 3,5-1.', 'Kratok  memiliki semua unsur gizi dengan nilai gizi yang cukup tinggi, yaitu karbohidrat 54,5 â€“74,2%, protein 17,9-29%, dan serat 3,5-1. Kacang kratok mempunyai manfaat sebagi sumber energy, menjaga stamina tubuh, menyehatkan tulang, baik untuk kesehatan gigi, melancarkan aliran darah, mencegah penyakit hipertensi, Anti penyakit anemia, mencegah penyakit diabetes, melancarkan pencernaan,menyehatkan otak, menambah kecerdasan dan anti penuaan dini ', 'kindom : Plantae\r\ndivisi:Spermatophyta\r\nkelas : Eudikotil\r\nordo : Fabales\r\nfamili : Fabaceae\r\ngenus : Phaseolus\r\nspesies : Phaseolus lunatus', 'sub_divisi : Angiospermae\r\nsub_famili : Faboideae\r\n', NULL, '2019-10-02 22:37:34', '2019-09-07 18:42:22', 1, 1),
('05-01-20185a4f35592caa1', 'buah', 'Nangka ', 'Nangka (Artocarpus heterophyllu)', 'Tanaman nangka merupakan tanaman tropis. Diduga, plasma nutfah (sumber genetik)\r\ntanaman nangka berasal dari kawasan tropis Asia.\r\nNangka merupakan buah lokal. Buah ini digolongkan sebagaibuah semu majemuk. Kulit luar buah berwarna kuning dan daging buah berwarna kuning (Hermanto, 2013). Dari empat kecamatan yang dijadikan sampel, buah nangka ditemuakan di Kecamatan Kaliwates dan  Kecamatan Balung .', 'kilojoule :  393 kj\r\nkalori : 94 kkal.\r\nprotein : 1,47 g.\r\nkarbohidrat : 24.01 g.\r\nsodium : 3 mg.\r\nkalium : 303 mg.', 'Mencegah penyakit kanker.\r\nMencegah penyakit anemia.\r\nMelancarkan sistem pencernaan.\r\nMenyehatkan dan menguatkan tulang.\r\nMenyehatkan mata.\r\nMenjaga sistem metabolisme tubuh.\r\nSumber energi tinggi pada tubuh.\r\nMembantu menurunkan tekanan darah.\r\nMencegah penyakit jantung.\r\nMemproduksi hormone.\r\nMengatasi asma.\r\nMengontrol kadar kolesterol.\r\nMeningkatkan sistem imun dalam tubuh.\r\nMenyehatkan usus besar.\r\nMenyembuhkan penyakit borok.\r\nMencegah penyakit kanker rongga mulut.', 'kindom : Plantae\r\ndivisi:Magnoliophyta\r\nkelas : Magnoliopsida\r\nordo : Urticales\r\nfamili : Moraceae \r\ngenus : Artocarpus \r\nspesies : Artocarpus heterophyllus ', '-', NULL, '2019-10-03 10:13:17', '2019-09-07 18:42:22', 1, 1),
('05-01-20185a4f3568cf3c9', 'sayur', 'Labu siam', 'Labu siam (Sechium edule)', 'Jenis tanaman ini banyak ditanam di kawasan Filipina, Malaysia, dan Indonesia. (Rukmana, 2016). Tanaman labu siam bersifat merambat dengan alat yang berbentuk pilin. Buahnya berbentuk bola lampu dan beralur-alur sebanyak 5-10 buah. Buahnya lunak (berdaging) dan banyak mengandung air. Pada permukaan buahnya tumbuh bulu-bulu yang tajam dan jarang seperti duri. Buahnya mengandung banyak air dan getah. Biji berbentuk panjang atau lonjong pipih dan berkeping dua. Biji buahnya besar dan lunak. Kulit buah tipis daun berduri jarang ', 'kilojoule : 109 kj.\r\nkalori : 26 kkal.\r\nlemak : 0,1 g.\r\nprotein : 1 g.\r\nkarbohidrat : 6,5 g.\r\nsodium : 1 mg.\r\nkalium : 340 mg.\r\n', 'Manfaat labu siam bagi kesehatan cukup banyak di antaranya untuk mencegah penyakit hingga membantu pola diet. Beberapa manfaat labu siam bagi kesehatan yang diadaptasi dari berbagai sumber di antaranya membantu menurunkan berat badan, mencegah bayi lahir cacat, membantu menurunkan kolesterol, mencegah penuaan dini. Labu siam mengandung kalori rendah hanya 16 kalori dalam setiap 100 gram. Selain itu labu siam tidak mengandung lemak jenuh dan kolesterol, namun mengandung serat yang cukup tinggi, sehingga baik untuk menurunkan berat badan dan kolesterol yang tinggi', 'kindom : Plantae\r\ndivisi:Magnoliophyta\r\nkelas : Magnoliopsida\r\nordo : Violales\r\nfamili : Cucurbitaceae\r\ngenus : Sechium\r\nspesies : Sechium edule', '', NULL, '2019-10-03 10:12:01', '2019-09-07 18:42:22', 1, 1),
('05-01-20185a4f35d95257b', 'sayur', 'Okra', 'Okra (Abelmoschus esculentus L.)', 'Tanaman ini berasal dari Afrika Barat. (Fauziana, 2016). Okra termasuk kedalam sayuran Malvaceae. Buah okra mempunyai ciri-ciri yaitu berusuk, panjang, dan ujungnya meruncing, buahnya lunak dan berwarna hijau. Tangkai buahnya berwarna hijau, di dalam buah okra terdapat biji yang berwarna putih.', 'kilojoule : 180 kj.\r\nkalori : 43 kkal.\r\nlemak : 2,32 g.\r\nprotein : 1,92 g.\r\nkarbohidrat : 5,08 g.\r\nsodium : 231 mg.\r\nkalium : 182 g.\r\n', 'Buah okra dipercaya dapat menurunkan kadar glukosa darah pada penderita diabetes (Prakoso, 2016). Buah okra memiliki kandungan air sebanyak 90%, 7% karbohidrat, 2 % protein, vitamin, terutama vitamin B. Okra paling kaya dengan kandungan kalsium. Okra bermanfaat untuk menurunkan berat badan, dapat membantu mencegah sembelit, membantu melindungi paru-paru, menjaga kesehatan kulit, mencegah rongga kanker rongga mulut, resiko cacat pada janin, membantu menjaga system kekebalan tubuh, dan memperkuat tulang gigi. ', 'kindom : Plantae\r\ndivisi:Magnoliopsida\r\nkelas : Magnoliopsida\r\nordo : Malvales\r\nfamili : Malvaceae\r\ngenus : Abelmoschus\r\nspesies : Abelmoschus esculentus L.', '', NULL, '2019-10-03 10:13:23', '2019-09-07 18:42:22', 1, 1),
('05-01-20185a4f3625dd59e', 'sayur', 'Labu Kuning ', 'Labu Kuning (Cucurbita moschata Duschesne)', 'Tanaman ini berasal dari benua Amerika, yaitu Peru dan Meksiko (Suprapto, 2005). Labu yang ditemukan dipasar yaitu labu yang berwarna hijau, dengan ukuran sekitar 1-4 kg. Buah labu berbentuk bermacam-macam, ada yang berbentuk pipih, lonjong atau memanjang dengan alur yang berjumlah sekitar 15 hingga 30 alur. Buah labu yang masih muda berwarna hijau dan berubah menjadi kuning kecokelatan ketika sudah tua. Daging labu yang masih muda berwarna putih dengan biji yang berwarna kuning dengan dilapisi kulit berwarna putih. Daun-daunnya besar, berlekuk dangkal kadang bercak putih, ukuran daun 20 x 30 cm, tangkai daun panjangnya 12-30 cm. Daun tanaman labu merupakan daun tunggal yang memiliki pertulangan daun majemuk menjari. Daunnya menyebar disepanjang batang. bentuk daun labu menyerupai jantung dan bertangkai. Warna daun labu adalah hijau dengan permukaan daunnya kasar. Tanaman ini dataran rendah hingga ketinggian 1.500 m', 'Kalori 29.\r\nProtein 1,1.\r\nLemak 0,3.\r\nKarbohidrat 6,6.\r\nKalsium 45 mg.\r\nFosfor 64 mg.\r\nBesi 1,4 mg.\r\nVitamin A 180 sl.\r\nVitamin B 0,08 mg.\r\nVitamin C 5,2 mg.\r\nAir 9,1.', 'Labu kuning mengandung vitamin A, B1, C, mineral, pektin dan serat makanan sehingga baik bagi kesehatan. Buah labu kuning mengandung Î²-karoten yang cukup tinggi yaitu sekitar 1800 IU atau 2100 Âµg. Dengan kandungan provitamin A yang cukup tinggi, labu kuning dapat digunakan sebagai salah satu bahan pangan sumber vitamin A yang merupakan antioksidan ', 'kindom : Plantae\r\ndivisi:Tracheophyta\r\nkelas : Magnoliopsida\r\nordo : Cucurbitales\r\nfamili : Cucurbitaceae\r\ngenus : Cucurbita L.\r\nspesies : Cucurbita moschata Ducesne', 'sub_kindom : Vindiplantae\r\n', NULL, '2019-10-02 16:12:21', '2019-09-07 18:42:22', 1, 1),
('05-01-20185a4f363972ef5', 'sayur', 'Pare', 'Pare (Momordica charantia)', 'Pare adalah tumbuhan merambat yang berasal dari wilayah Asia Tropis, terutama daerah India bagian barat, yaitu Assam dan Burma (Wijayakusuma, 2008) Pare (Momordica charantia L.) termasuk family Cucurbitaceae. Tanaman pare bisa tumbuh di tanah yang gembur, banyak mengandung humus dan tidak memerlukan banyak sinar matahari. Buah pare berbentuk lonjong, kecil dan berwarna hijau. Permukaan kulit buahnya berbintil-bintil agak halus. Buah pare masih muda berwarna hijau muda dan setelah tua berwarna orange kekuningan. Daging buah pare berwarna hijau didalamnya terdapat biji yang berwarna cokelat yang dilapisi oleh kulit yang berwarna putih', 'kilojoule : 121 kj.\r\nkalori : 29 kkal.\r\nlemak : 0,22 g.\r\nprotein : 1,12 g.\r\nkarbohidrat : 6,82 g.\r\nsodium : 10 mg.\r\nkalium : 360 mg.\r\n', 'Buah pare dapat dijadikan obat bagi penderita penyakit deam, terutama demam karena penyakit malaria, daunnya berguna sebagai obat untuk membersihkan darah. Pare juga dapat merangsang nafsu makan dan dapat menurunkan kadar gula dalam darah (diabetes)', 'kindom : Plantae\r\ndivisi:Magnoliophyta\r\nkelas : Magnoliopsida\r\nordo : Violales\r\nfamili : Cucurbitaceae\r\ngenus : Momordica\r\nspesies : Momordica charantia', '', NULL, '2019-10-03 10:15:24', '2019-09-07 18:42:22', 1, 1),
('05-01-20185a4f36eacf417', 'sayur', 'Petai/ Pete ', 'Petai/ Pete (Parkia speciosa)', 'Tanaman petai diperkirakan berasal dari Malaysia.\r\nPete/ petai termasuk kedalam tanaman sayur Mimosaceae. Sayuran ini merupakan sayuran yang mempunyai wangi yang khas. Buah petai berbentuk polong besar, pipih, panjang dan berwarna hijau. Dalam buahnya terdapat beberapa biji yang letaknya melintang buah. Bijinya dibalut selaput kulit tipis berwarna putih kotor pada petai muda sedangkan pada petai yang tua kulit bijinya  menjadi lunak berwarna kuning', 'kilojoule :  381 kj\r\nkalori : 91 kkal.\r\nlemak : 0,37 g.\r\nprotein : 6,58 g.\r\nkarbohidrat : 16,62 g.\r\nsodium : 7 mg.\r\nkalium : 413 mg.', 'Pete mempunyai manfaat untuk mengurangi kolesterol, mengobati sakit jantung, meredakan depresi, dapat mengatasi gangguan PMS, mencegah terjadinya anemia, menurunkan tekanan darah tinggi, mencegah terjadinya kegemukan, baik untuk kesehatan lambung, mencegah serangan stroke, mengandung antioksidan, mengandung vitamin C yang tinggi, mengandung Antioksidan dan kaya kandungan vitamin A\r\n', 'kindom : Plantae\r\ndivisi:Magnoliophyta\r\nkelas : Magnoliopsida\r\nordo : Fabales\r\nfamili : Fabaceae\r\ngenus : Parkia\r\nspesies : Parkia speciosa', 'sub_famili : Mimosoideae\r\n', NULL, '2019-10-03 10:16:08', '2019-09-07 18:42:22', 1, 1),
('05-01-20185a4f36f14008e', 'sayur', 'Mentimun ', 'Mentimun (Cucumis sativus L.)', 'Mentimun berasal dari Cina bagian tengah dan barat. Mentimun juga ditemukan juga di India timur laut dan Myanmar (Rukmana, 1994). Mentimun atau ketimun (Cucumis sativus L.) merupakan salah satu jenis sayuran dari keluarga labu-labuan (Cucubitaceae).mentimun yang ditemukan yaitu mentimun yang buahnya  terdapat bintil-bintil seperti jerawat, terutama pada bagian pangkal buah. Mentimun biasa buahnya saat muda berwarna hijau, setelah tua berwarna cokelat.  Kulit buahnya berwarna hijau dengan daging buah yang berwarna putih dan bijinya berwarna putih. panjang buah mentimun kurang lebih 13 cm - 20 cm dengan berat kurang lebih 2 ons.', 'kilojoule : 50 kj.\r\nkalori : 12 kkal.\r\nlemak : 0,16 g.\r\nprotein : 0,59 g.\r\nkarbohidrat : 2,16 g.\r\nsodium : 2 mg.\r\nkalium : 136 mg.\r\n', 'Mentimun (Cucumissativum, L) berkhasiat sebagai peluru air seni (diuretika), tekanan darah tinggi (hipertensi), menghaluskan kulit, obat-obat cacing (anthelmintik) ', 'kindom : -\r\ndivisi:Spermatophyta\r\nkelas : Dicotylodenae\r\nordo : Cucurbitales\r\nfamili : Cucurbitaceae\r\ngenus : Cucumis\r\nspesies : Cucumis sativus L. ', 'sub_divisi : Angiospermae\r\n', NULL, '2019-10-03 10:12:46', '2019-09-07 18:42:22', 1, 1),
('05-01-20185a4f3719939b1', 'buah', 'Sirsak', 'Sirsak (Annona muricata)', 'on. Tumbuhan yang memiliki nama latin Annona muricnata L ini\r\nmasuk ke Indonesia pertama kali pada abad ke 19 oleh pemerintah kolonial Belanda dengan\r\nnama zuurzak berarti “kantung asam” sehingga namanya menjadi sirsak.\r\nBuah sirsak merupakan buah lokal. Buah ini digolongkan sebagai buah sejati ganda. Kulit luar buah berwarna hijau dan daging buah berwarna putih (Hermanto, 2013). Dari empat kecamatan yang dijadikan sampel, buah sirsak ditemuakan di Kecamatan Tanggul, Kaliwates, Ambulu dan Balung.', 'kilojoule :  276 kj\r\nkalori : 66 kkal.\r\nlemak : 0,3 g.\r\nprotein : 1 g.\r\nkarbohidrat : 16,84 g.\r\nsodium : 14 mg.\r\nkalium : 270 mg.', 'Mencegah kanker.\r\nMenyembuhkan infeksi.\r\nMenyehatkan kulit.\r\nMembunuh sel kanker di pankreas.\r\nMeminimalisir gangguan penglihatan.', 'kindom : Plantae\r\ndivisi:Magnoliophyta\r\nkelas : Magnoliopsida\r\nordo : Magnoliales\r\nfamili : Annonaceae\r\ngenus : Annona\r\nspesies : Annona muricata', '', NULL, '2019-10-03 10:23:40', '2019-09-07 18:42:22', 1, 1),
('05-01-20185a4f37873f719', 'sayur', 'Oyong/gambas ', 'Oyong/gambas (Luffa acutangula)', 'Tanaman oyong ini berasal dari India dan sekarang telah beradaptasi dengan baik di daerah Asia Tenggara termasuk Indonesia. Oyong/gambas termasuk dalam sayuran Cucurbitaceae. Oyong dapat ditanam di dataran rendah maupun dataran tinggi (pegunungan). Buah oyong berbentuk bulat panjang dan berusuk-rusuk (lingir). Bentuk buahnya menyerupai belimbing dengan siku-siku yang memanjang. Jumlah rusuk yang jelas yaitu sebanyak 10 buah panjangnya sekitar 15â€“30 cm. Kulitnya keras seperti kaktus dengan daging yang lunak dan halus.  Jika dipotong buah oyong terlihat roda-roda bergigi. Warna kulitnya hijau tua, sedangkan dagingnya berwarna putih seperti busa, dan bijinya berwarna hijau muda ', 'kilojoule :75 kj.\r\nkalori : 18 kkal.\r\nlemak : 0,18 g.\r\nprotein : 1,08 g.\r\nkarbohidrat : 4,02 g.\r\nsodium : 4 mg.\r\nkalium : 210 mg.\r\n', 'Oyong selain kaya akan gizi juga dipecaya mampu menyembuhkan beberapa penyakit dan dapat menurnkan panas tinggi ataupun demam. Manfaat oyong bagi kesehatan tubuh dan kecantikan diantaranya melancarkan darah, obat penyakit asma, mencegah terjadinya diabetes, menjaga kecantikan kulit. Oyong dapat membantu melancarkan peredaran darah, melancarkan system pencernaan, mengatasi anak cacingan, mengatasi radang tenggorokan, melancarkan ASI, menghilangkan garis gelap dibawah mata, menyehatkan dan menghilangkan tanda penuaan kulit ', 'kindom : Plantae\r\ndivisi:Magnoliophyta\r\nkelas : Magnoliopsida\r\nordo : Cucurbitales\r\nfamili : Cucurbitaceae\r\ngenus :  Luffa\r\nspesies : Luffa acutangula', '', NULL, '2019-10-03 10:14:23', '2019-09-07 18:42:22', 1, 1),
('05-01-20185a4f378d51d6c', 'buah', 'Nanas ', 'Nanas (Ananas comosus)', 'Tanaman nanas berasal dari Amerika tropis, yakni Brasil, Argentina, dan Peru. Pada\r\nsaat ini, nanas telah tersebar ke seluruh dunia.\r\nNanas merupakan buah lokal. Buah ini digolongkan sebagaibuah sejati majemuk. Kulit luar buah berwarna hijau kekuningan dan daging buah berwarna kuning (Hermanto, 2013). Dari empat kecamatan yang dijadikan sampel, buah nanas ditemuakan di Kecamatan Kaliwates, Kecamatan Balung, Kecamatan Ambulu, dan Kecamatan Tanggul.', 'kilojoule : 201  kj\r\nkalori : 48 kkal.\r\nlemak ; 0,12 g.\r\nprotein : 0,54 g.\r\nkarbohidrat : 12,63 g.\r\nsodium : 1 mg.\r\nkalium : 115 mg.', 'Membantu mengobati radang sendi.\r\nMeningkatkan imunitas.\r\nMenciptakan kolagen.\r\nMencegah kanker.\r\nMenunjang kesehatan pencernaan.\r\nMembantu mengobati batuk dan pilek.\r\nMenjaga kesehatan tulang.\r\nMenjaga kesehatan mulut.\r\nMembantu menjaga kesehatan mata.\r\nMembantu mengatur tekanan darah.\r\nMenjaga sirkulasi darah.\r\nSolusi efektif untuk jerawat.', 'kindom : Plantae\r\ndivisi:Magnoliophyta\r\nkelas : Liliopsida \r\nordo : Bromeliales\r\nfamili : Bromeliaceae\r\ngenus : Ananas\r\nspesies : Ananas comosus', '-', NULL, '2019-10-03 10:12:47', '2019-09-07 18:42:22', 1, 1),
('05-01-20185a4f37998314e', 'sayur', 'Terung', 'Terung (Solanum melongena)', 'Terung berasal dari Asia terutama India dan Birma (Sunarjono, 2016). Terung termasuk ke dalam sayuran Solanaceae yang bisa ditanam baik didataran rendah maupun dataran tinggi. Bentuk buahnya lonjong dengan 2 warna yaitu terung yang buahnya berwarna ungu dan terung yang buahnya berwarna hijau. Daging buahnya berwarna putih dan bijinya berwarna kecokelatan. Panjang buah terong kurang lebih 7 cm terung yang kecil dan yang panjang sekitar 15 cm ', 'kilojoule : 100 kj.\r\nkalori : 24 kkal.\r\nlemak : 0,19 g.\r\nprotein : 1,01 g.\r\nkarbohidrat : 5,7 g.\r\nsodium : 2 mg.\r\nkalium : 230 mg.\r\n', 'Buah terung mengandung zat aktif yang berfungsi untuk kontrasepsi. Selain itu, buh terung dapat mencegah penyakit diabetes dan meningkatkan gairah kerja. Namun, bagi penderita penyakit radang usu/ padang anus dan wanita penderita sakit pembesaran kandungan tidak diperbolehkan makan buah terung karena dapat menimbulkan hal-hal kurang baik. Terung juga buahnya baik sekali untuk obat kencing manis ', 'kindom : Plantae\r\ndivisi:-\r\nkelas : Magnoliopsida\r\nordo : Solanales\r\nfamili : Solanaceae\r\ngenus : Solanum\r\nspesies : Solanum melongena', 'sub_kelas : Asteridae\r\n', NULL, '2019-10-03 10:16:53', '2019-09-07 18:42:22', 1, 1),
('05-01-20185a4f38168e97f', 'sayur', 'Petai cina ', 'Petai cina (Laucaen gluca)', 'Tanaman ini berasal dari Amerika tropis (Oktarlina, 2017). Petai cina termasuk kedalam kelas Dicotylodenae. Buah polong (legumen) berbentuk piph dan tipis berukura panjang 14-22 cm lebar 1,5-2 cm dengn sekat diantara biji. Berwaran hijau dan jika masak berwarna coklat kering berisi 15-30 biji yang terletak melingkar dalam polong. Termasuk buah polong (legumen) berbentuk pipih dan tipis berukuran panjang 14-22 cm lebar 1,5-2 cm dengan sekat diantara biji  ', 'kilojoule : 381 kj.\r\nkalori : 91 kkal.\r\nlemak : 0,37 g.\r\nprotein : 6,58 g.\r\nkarbohidrat : 16,62 g.\r\nsodium : 7 mg.\r\nkalium : 413 mg.\r\n', 'Petai cina mengandun zat aktif yang berupa alkaloid, saponin,flavonoid, mimosin, lektin,  protein, lemak, kalsium, fosfor, zat besi, vitamin A dan vitamin B. Berbagai kandungan yang terdapat dalam daun petai cina diperkirakan sebagai antiinflamasi adalah flavanoid. Sementara lektin berfungsi menstimulasi pertumbuhan sel kulit. Antibiotik yang terkandung dalam saponin dapat mempercepat penyembuhan luka karena menghambat pertumbuhan bakteri ', 'kindom : Plantae\r\ndivisi:Spermatophyta\r\nkelas : Dicotylodenae\r\nordo : Fabales\r\nfamili : Rosalles \r\ngenus : Leucaen\r\nspesies : Laucaen gluca', 'sub_divisi : Angiospermae\r\n', NULL, '2019-10-03 10:16:22', '2019-09-07 18:42:22', 1, 1),
('05-01-20185a4f382b84e05', 'sayur', 'Tomat', 'Tomat (Solanum lycopersicum L.)', 'Berasal dari Amerika terutama peru dan equador, kemudian masuk ke erpopa dan penyebarannya ke benua Asia dan dimulai dari filipina melewati jalur Amerika Selatan\r\n(Sunarjono, 2016). Tomat mempunyai nama ilmiah Solanum lycopersicum L., termasuk ke dalam keluarga terong-terongan (Solanaceae), masih satu keluarga dengan cabai, terong ungu, ataupun kentang. Buah tomat termasuk buah buni, berdaging, dan banyak mengandung air terutama pada bagian rongga tempat bijinya. Bentuk buahnya bulat pipih, lunak, dan tidak teratur. Kulit buah berwarna hijau ketika masih mentah, dan akan berubah menjadi merah jika sudah matang ', 'kilojoule : 75kj.\r\nkalori : 18 kkal.\r\nlemak : 0,2 g.\r\nprotein : 0,88 g.\r\nkarbohidrat : 3,92 g.\r\nsodium : 5 mg.\r\nkalium : 237 mg.\r\n', 'Buah tomat baik bagi penderita penyakit wasi (haemorrhoid). Rujak tomat, air tomat dan gula dapat diberikan pada anak-anak, bayi dan orang yang baru menderita sakit. Namun, obat itu tidak dianjurkan untuk yang sering menderita sakit perut. Selain itu, tomat dapat melicinkan kulit terutama muka, sehingga baik untuk perawatn kecantikan', 'kindom : Plantae\r\ndivisi:Magnoliophyta\r\nkelas : Magnoliopsida\r\nordo : Solanales\r\nfamili : Solanaceae\r\ngenus : Solanum\r\nspesies : Solanum lycopersicum L', 'sub_kindom : Tracheobionta\r\nsub_divisi : Spermatophyta\r\nsub_kelas : Asteridae\r\n', NULL, '2019-10-03 10:17:52', '2019-09-07 18:42:22', 1, 1),
('05-01-20185a4f38be20a0e', 'buah', 'Sawo', 'Sawo (Manilkara zapota)', 'Tanaman sawo berasal dari Amerika Tengah, yakni Meksiko dan Indian Barat.\r\nBuah sawo merupakan buah lokal. Buah ini digolongkan sebagai buah sejati tunggal berdaging. Kulit luar buah berwarna coklat dan daging buah berwarna coklat (Hermanto, 2013). Dari empat kecamatan yang dijadikan sampel, buah sawo ditemuakan di Kecamatan Ambulu, dan Kecamatan Balung. ', 'kilojoule :  347 kj\r\nkalori : 83 kkal.\r\nlemak : 1,1 g.\r\nprotein : 0,44 g.\r\nkarbohidrat : 19,90 g.\r\nsodium : 12 mg.\r\nkalium : 193 mg.', 'Kandungan kalium dan natrium buah sawo\r\ndiperlukan untuk menjaga kesehatan jantung dan\r\npembuluh darah.\r\nKandungan serat yang baik sehingga dapat\r\nmengobati sembelit dan melindungi selaput\r\nlendir susu dari racun yang dapat menyebabkan\r\nkanker.\r\nSebagai antiradang, antivirus, antibakteri, dan\r\nanti parasit.\r\nDapat mengatasi gangguan erosif\r\ngastritis,refluks esofagitis, enteritis, dan\r\ngangguan usus.\r\nSebagai penghalang radikal bebas.\r\n', 'kindom : Plantae\r\ndivisi:Magnoliophyta\r\nkelas : Magnoliopsida\r\nordo : Ebenales \r\nfamili : Sapotaceae \r\ngenus : Manilkara \r\nspesies : Manilkara zapota', '', NULL, '2019-10-03 10:21:54', '2019-09-07 18:42:22', 1, 1),
('05-01-20185a4f39014cc78', 'sayur', 'Tekokak', 'Tekokak (Solanum torvum sp)', 'Tanaman ini berasal dari Asia terutama India dan Birma (Sunarjono, 2016). Tekokak termasuk ke dalam sayuran Solanaceae atau terung-terungan yang dicirikan dengan batang dan daunnya berbulu halus sampai kasar. Bentuk buah tekokak bulat kecil yang berwarna hijau didalamnya terdapat banyak biji yang berwarna cokelat dan ditangkai buahnya terdapat duri-duri kecil yang sedikit tajam. Besar buah tekokak hamper dua kali besar buah leunca dengan garis tengah 1-1,5 cm ', 'Takokak mengandung vitamin A, klorogenin, sisalogenone, solasonin, neoclorogenin,\r\npanicolugenin, jurubine, maupun torvogenin. (Sunarjono, 2016).', 'Tanaman takokak (Solanum torvum sp) memiliki senyawa sterol carpesterol yakni pada buah dan daunnya. Buahdan daunnya mengandung solasodin 0,84% yang merupakan bahan baku hormone seks untuk kontrasepsi ', 'kindom : Plantae\r\ndivisi:Magnoliophyta\r\nkelas : Magnoliopsida\r\nordo : Solanales\r\nfamili : Solanaceae\r\ngenus : Solanum\r\nspesies : Solanum torvum sp.', 'sub_kindom : Tracheobionta\r\n', NULL, '2019-10-02 15:57:36', '2019-09-07 18:42:22', 1, 1),
('05-01-20185a4f39200d7cf', 'sayur', 'Bawang Daun ', 'Bawang Daun (Allium fistulosum L)', 'Tanaman ini berasal dari Asia tengah yaitu palestina dan india (Sunarjono, 2016). Bawang daun merupakan tanaman setahun yang berbentuk rumput. Struktur bunganya sama dengan bawang merah. Warna bunganya putih. Daunnya bulat panjang dan berlubang seperti bunga ', 'kilojoule : 255 kj.\r\nkalori : 61 kkal.\r\nlemak : 0,3 g.\r\nprotein : 1,5 g.\r\nkarbohidrat : 14,15 g.\r\nsodium : 20 mg.\r\nkalium : 180 mg.\r\n', 'Bawang daun mengandung vitamin C, banyak vitamin A, dan sedikit vitamin B. Kangdungan zat gizi bawang daun lebih baik dari pada bawang merah ', 'kindom : Plantae\r\ndivisi:Magnoliophyta\r\nkelas : Liliopsida\r\nordo : Liliales\r\nfamili : Liliaceae\r\ngenus : Allium\r\nspesies : Allium fistulosum L. ', 'sub_kindom : Tracheobionta\r\nsub_divisi : Spermatophyta\r\nsub_kelas : Liliidae\r\n', NULL, '2019-10-03 10:18:24', '2019-09-07 18:42:22', 1, 1),
('05-01-20185a4f397d6a19c', 'sayur', 'Bayam Merah', 'Bayam Merah (Amaranthus gangeticus L.)', 'Tanaman ini berasal dari Amerika (Sunarjono, 2016). Bayam merah termasuk ke dalam family Amaranthaceae. Sayuran ini dapat tumbuh di dataran rendah maupun didataran tinggi. Bayam merah memiliki batang dan daun berwarna merah. Memiliki tinggi batang sekitar 0,4-1 meter dan bercabang, batang lemah dan berarir, daun bertangkai, berbentuk bulat telur serta pangkal runcing berwarna merah ', 'kilojoule : 96 kj.\r\nkalori : 23 kkal.\r\nlemak : 0,39 g.\r\nprotein : 2,86 g.\r\nkarbohidrat : 3,63 g.\r\nsodium : 79 mg.\r\nkalium : 558 mg.\r\n', 'Bayam merah memiliki banyak manfaat bagi kesehatan contohnya dapat memperlancar  sistem pencernaan, menurunkan resiko terkena kanker, mengurangi kolesterol, dan anti diabetes. Bayam juga dapat memperbaiki daya kerja ginjal dan melancarkan pencernaan. Selain itu, bayam sengat baik untuk orang yang baru sembuh dari penyakit, terutama anak-anak dan bayi. Untuk bayi, bayam daoat dicampur dengan nasi tim. Adapun akar bayam merah dapat digunakan sebagai penyakit disentri. Bayam harus dikonsumsi paling lama 12 jam setelah dimasak karena kandungan vitamin dan mineralnya akan berkurang', 'kindom : Plantae\r\ndivisi:Magnoliophyta\r\nkelas : Magnoliopsida\r\nordo : Caryophyllales\r\nfamili : Amaranthaceae\r\ngenus : Aamaranthus\r\nspesies : Amaranthus gangeticus L', '', NULL, '2019-10-03 10:19:16', '2019-09-07 18:42:22', 1, 1);
INSERT INTO `ensiklopedia_data` (`data_id`, `kategori`, `nama`, `jenis`, `deskripsi`, `kandungan`, `manfaat`, `klasifikasi`, `sub_klasifikasi`, `video`, `created_at`, `updated_at`, `is_active`, `cek`) VALUES
('05-01-20185a4f3986ea29c', 'sayur', 'Terong Gelatik ', 'Terong Gelatik (Solanum melongena)', 'Berasal dari Asia terutama India dan Birma (Sunarjono, 2016). Terong gelatik termasuk kedalam sayuran Solanaceae. Buah gelatik bentukya bundar dengan warna hijau keputih-putihan dan berwarna ungu. Ditangkainya terdapat duri-duri kecil yang sedikit tajam. Kulit terong gelatik berwarna hijau dengan garis-garis putih dengan daging buah yang berwarna putih dan didalam buah terdapat biji yang berwarna cokelat. Ukuran terong gelatik sebesar bola bekel ', 'kilojoule : 100 kj.\r\nkalori : 24 kkal.\r\nlemak : 0,19 g.\r\nprotein : 1,01 g.\r\nkarbohidrat : 5,7 g.\r\nsodium : 2 mg.\r\nkalium : 230 mg.\r\n', 'Buah terung mengandung zat aktif yang berfungsi untuk kontrasepsi. Selain itu, buh terung dapat mencegah penyakit diabetes dan meningkatkan gairah kerja. Namun, bagi penderita penyakit radang usus/ padang anus dan wanita penderita sakit pembesaran kandungan tidak diperbolehkan makan buah terung karena dapat menimbulkan hal-hal kurang baik. Terung juga buahnya baik sekali untuk obat kencing manis ', 'kindom : Plantae\r\ndivisi:-\r\nkelas : Magnoliopsida\r\nordo : Solanales\r\nfamili : Solanaceae\r\ngenus : Solanum\r\nspesies : Solanum melongena', '', NULL, '2019-10-03 10:17:21', '2019-09-07 18:42:22', 1, 1),
('05-01-20185a4f39f972ab2', 'buah', 'Apel ', 'Apel Fuji rosy blash', '1.	Apel Fuji Rosy Blash\r\nApel fuji rosy blash merupakan buah impor. Buah ini digolongkan sebagai buah sejati tunggal berdaging. Kulit luar buah berwarna merah muda dan daging buah berwarna putih (Yulianti, 2007). Dari empat kecamatan yang dijadikan sampel, apel fuji rosy blash ditemuakan di Kecamatan Tanggul, Kaliwates, Ambulu dan Balung. \r\n', '-', '-', 'kindom : Plantae\ndivisi:Spermatophyta\nkelas : Dicotyledone\nordo : Rosales\nfamili : Rosaceae\ngenus : Malus\nspesies : Malus sylvestris Mill', '', NULL, '2019-09-07 20:42:22', '2019-09-07 18:42:22', 1, 1),
('05-01-20185a4f3a07bc5ac', 'sayur', 'Boboan', 'Boboan (Cleome rutidosperma D.C)', 'Ditemukan di pinggir jalan, sawah, ladang. Juga ditemukan hidup sebagai epifit pada batu dan kayu. Terutama banyak ditemukan di Kalimantan (Waterhouse & Mitchell, 1998). Herba tegak, merambat atau tumbuh merangkak tinggi 0.15-0,80 m, berbunga sepanjang tahun. Daun mahkota bunga dengan ujung runcing seperti cakar, panjang 9-12 mm; di Jawa berwarna biru; bulu-bulu halus yang pendek; tangkai buah 20-30 mm; batang (berbentuk kapsul) yang masak berada di atas goresan daun berangsur-angsur meruncing seperti paruh; diameter biji 1,75-2 mm, elaiosom keputihan; helaian daun biasanya 3, bentuk daun memanjang atau bulat memanjang, tajam atau tumpul, dengan bulu-bulu tebal pendek; batang 0,5-2 cm dengan duri tipis.\r\n	Boboan dapat ditemukan di pinggir jalan, sawah, ladang. Juga ditemukan hidup sebagai epifit pada batu dan kayu. Boboan tumbuh pada daerah yang kering ', 'Anggota famili Capparaceae mengandung tioglukosida (dikenal sebagai glukosinolat) yang melepaskan isotiosianat (minyak menguap) jika tanaman dihancurkan. Selain itu tanaman ini juga mengandung alkaloid dan flavonoid yang jenisnya belum  diketahui (Mitchell et al.,2003).', 'Boboan (Cleome rutidosperma) dapat digunakan sebagai antifeedant (pengganti herbisida) untuk hama tanaman Brassica yaitu jenis Plutella xylostella (L.)', 'kindom : Plantae\r\ndivisi:Spermatophyta\r\nkelas : Dicotyledone\r\nordo : Capparidales\r\nfamili : Capparidaceae\r\ngenus : Cleome\r\nspesies : Cleome rutidosperma D.C', '', NULL, '2019-10-02 15:49:28', '2019-09-07 18:42:22', 1, 1),
('05-01-20185a4f3a25d762e', 'sayur', 'Bayam Hijau ', 'Bayam Hijau (Amaranthus spinosus)', 'Tanaman bayam berasal dari daerah Amerika tropis (Sunarjono, 2016). Bayam termasuk ke dalam family Amaranthaceae. Bayam dapat tumbuh sepanjang tahun, baik di dataran rendah maupun dataran tinggi. Bayam ini memiliki dasar daun yang lebar dan berwarna hijau. Bentuk daunnya ada yang besar, kecil dan lembut. Batangnya berwarna hijau dan akarnya berwarna cokelat kemerahan ', 'kilojoule : 96 kj.\r\nkalori : 23 kkal.\r\nlemak : 0,39 g.\r\nprotein : 2, 86 g.\r\nkarbohidrat : 3,63 g.\r\nsodium : 79 mg.\r\nkalium : 558 mg.\r\n', 'Bayam dapat memperbaiki daya kerja ginjal dan melancarkan pencernaan. Selain itu, bayam sengat baik untuk orang yang baru sembuh dari penyakit, terutama anak-anak dan bayi. Untuk bayi, bayam daoat dicampur dengan nasi tim. Adapun akar bayam merah dapat digunakan sebagai penyakit disentri. Bayam harus dikonsumsi paling lama 12 jam setelah dimasak karena kandungan vitamin dan mineralnya akan berkurang ', 'kindom : Plantae\r\ndivisi:Magnoliophyta\r\nkelas : Magnoliopsida\r\nordo :  Caryophyllales\r\nfamili : Amaranthaceae\r\ngenus : Amaranthus\r\nspesies : Amaranthus spinosus', '', NULL, '2019-10-03 10:18:55', '2019-09-07 18:42:22', 1, 1),
('05-01-20185a4f3a6d15ccf', 'buah', 'Apel', 'Apel Green Smiit', '2.	Apel Green Smith\r\nApel green smith merupakan buah impor. Buah ini digolongkan sebagai buah sejati tunggal berdaging. Kulit luar buah berwarna hijau dan daging buah berwarna putih (Yulianti, 2007). Dari empat kecamatan yang dijadikan sampel, apel green smiit  ditemuakan di Kecamatan Kaliwates.\r\n', '-', '-', 'kindom : Plantae\ndivisi:Spermatophyta\nkelas : Dicotyledone\nordo : Rosales\nfamili : Rosaceae\ngenus : Malus\nspesies : Malus sylvestris Mill', '', NULL, '2019-09-07 20:42:22', '2019-09-07 18:42:22', 1, 1),
('05-01-20185a4f3a7b35faf', 'sayur', 'Daun Katu', 'Daun Katu(Sauropus androgynus)', 'Tanaman ini berasal dari Asia Tenggara. (Suryo, 2010). Tanaman katuk tumbuh menahun, berbentuk semak perdu dengan ketinggian sekitar 1,5-5 meter, dan merumpun. dayun katu tumbuh majemuk genap, berukuran kecil, bentuknya lonjong sampai bundar seperti daun kelor yang tersusun dalam tangkai dain, ukuran panjangnya 2,5 cm dan lebar 1,25-3 cm. Anak daun berbentuk bulat telur dengan ujung lancip, strukturnya tipis dengan pangkal tumpul, dan tepinya rata. permukaan atas daun berwarna hijau gelap, sedangkan permukaan bawah daun berwarna hijau muda', 'kilojoule : 251 kj.\r\nkalori : 60 kkal.\r\nlemak : 1,28 g.\r\nprotein : 4,72 g.\r\nkarbohidrat : 10,72 g.\r\nsodium : 5mg.\r\nkalium : 411 mg.\r\n', 'Tanaman katuk multimanfaat dalam kegidupan sehari-hari. Beberapa manfaat tanaman katuk adalah sebagai sumber gizi, berkhasiat obat, pewarna dan sarana produk. Mengonsumsi sayur katuk oleh ibu menyusui dapat memperlama waktu menyusui bayi perempuan secara nyata dan untuk bayi laki-laki meningkatkan frekuensi dan lama menyusui. Di Taiwan, jus daun katuk mentah digunakan sebagai pelangsing tubuh', 'kindom : Plantae\r\ndivisi:Magnoliophyta\r\nkelas : Magnoliopsida\r\nordo : Malpighiales\r\nfamili : Phyllanthaceae\r\ngenus : Sauropus\r\nspesies : Sauropus androgynus', '', NULL, '2019-10-03 10:20:24', '2019-09-07 18:42:22', 1, 1),
('05-01-20185a4f3abe51c5e', 'sayur', 'Gunda', 'Gunda (Sphenoclea zeylanica Gaertn)', 'Berasal dari kawasan Asia, gonda meyebar ke hampir seluruh dunia (Junarta, 2016). Tanaman gunda merupakan tanaman akuatik dengan ciri morfologi batang berongga menyerupai tanaman kangkung dan tergolong tumbuhan setahun. Umumnya tanaman gonda tersebar pada wilayah yang memiliki ketinggian 1-300 m dpl dengan lingkungan tumbuh tanah berlumpur seperti lahan persawahan, saluran irigasi dan tepian sungai. Penyebaran tanaman gonda secara global yaitu pada wilayah tropis sampai sub-tropis', 'Hasil analisis kimia pada sayurGonda berdasarkan berat kering (Gunadi 1991), mengandung 70,30% karbohidrat, 18,27 % protein kasar, 4,47% lemak dan 6,69% abu (Junarta, 2016).', 'Tanaman gunda bermanfaat sebagai obat penyakit liver, baik untuk pncernaan, menyehatkan saluran kencing, mengatasi rematik, obat pegal linu, pereda nyeri, menyehatkan mata, membantu kesehatan usus, baik untuk lambung, obat sulit buang air besar, menyembuhkan diare, mengatasi infeksi saluran kecing, membersihkan saluran kemih, mencegah peradagangan ', 'kindom : Plantae\r\ndivisi:Spermatophyta\r\nkelas : Dicotylodenae\r\nordo : Solanales\r\nfamili : Sphenocleaceae\r\ngenus : Sphenoclea Gaertn\r\nspesies : Sphenoclea zeylanica ', 'sub_divisi : Angiospermae\r\n', NULL, '2019-10-02 15:50:21', '2019-09-07 18:42:22', 1, 1),
('05-01-20185a4f3ac5e3e01', 'buah', 'Apel', 'Apel Red Dell USA', '3.	Apel Red Dell USA\r\nApel Red Dell USA merupakan buah impor. Buah ini digolongkan sebagai termasuk buah sejati tunggal berdaging. Kulit luar buah berwarna hijau dan daging buah berwarna putih (Yulianti, 2007). Dari empat kecamatan yang dijadikan sampel, apel Red Dell USA ditemuakan di Kecamatan Tanggul, Kaliwates, Ambulu dan Balung. \r\n', '-', '-', 'kindom : Plantae\ndivisi:Spermatophyta\nkelas : Dicotyledone\nordo : Rosales\nfamili : Rosaceae\ngenus : Malus\nspesies : Malus sylvestris Mill', '', NULL, '2019-09-07 20:42:22', '2019-09-07 18:42:22', 1, 1),
('05-01-20185a4f3adb9e993', 'sayur', 'Daun salam', 'Daun salam (Syzygium polyanthum)', 'Salam ( Indonesian bay leaf, Indonesian laurel, Syzygium polyanthum), adalah daun aromatik untuk bumbu di Indonesia, Malaysia, Thailand, sampai ke India. Daun salam termasuk kedalam kelas Magnoliopsida dengan nama species Syzygium polyanthum. Warna daun salam ada dua yaitu daun yang masih muda berwarna cokelat kekuningan sedangkan daun yang sudah tua berwarna hijau tua. Dengan tulang daun yang berwarna hijau muda dan tangkainya daunnya berwarna merah kekuningan sedangkan batangnya berwarna hijau kecokelatan ', 'Antioksidan.\r\nRutin, salisilat, asam caffeic, dan fitonutrien.\r\nFlavonoid.\r\nAsam laurat.\r\nVitamin a dan c.', 'Daun salam (Syzygium polyanthum) mengandung tannin, flavonoid, dan minyak asiri yang terdiri dari sitrat dan eugenol. Berfungsi sebagai peluruh air seni dan penghilang nyeri.\r\nObat anti cacing.\r\nMengatasi masalah pencernaan.\r\nMenyehatkan mata.\r\nMengatasi migraine.\r\nUntuk kesehatan rambut.\r\nMengobati inveksi ginal dan batu ginjal.', 'kindom : Plantae\r\ndivisi:Magnoliophyta\r\nkelas : Magnoliopsida\r\nordo : Myrtales\r\nfamili : Myrtaceae\r\ngenus : Syzygium\r\nspesies : Syzygium polyanthum', '', NULL, '2019-10-02 14:55:30', '2019-09-07 18:42:22', 1, 1),
('05-01-20185a4f3b1aefce1', 'buah', 'Apel', 'Apel Royal Gala', '4.	Apel Royal Gala\r\nApel royal gala merupakan buah impor. Buah ini digolongkan sebagai buah sejati tunggal berdaging. Kulit luar buah berwarna merah dan daging buah berwarna putih kekuningan (Yulianti, 2007). Dari empat kecamatan yang dijadikan sampel, apel royal gala  ditemuakan di Kecamatan Kaliwates. \r\n', '-', '-', 'kindom : Plantae\ndivisi:s\nkelas : Dicotyledone\nordo : Rosales\nfamili : Rosaceae\ngenus : Malus\nspesies : Malus sylvestris Mill', '', NULL, '2019-09-07 20:42:22', '2019-09-07 18:42:22', 1, 1),
('05-01-20185a4f3b37f3625', 'sayur', 'Caisin/ Sawi mie ', 'Caisin/ Sawi mie (Brassica chinensis L.)', 'Berasal dari Tiongkok atau Cina dan Asia timur (Umiyah, 2013). Caisim termasuk kedalam kelas Dicotyledone dan termasuk ke dalam family Cruciferae yaitu tanaman kubis-kubisan. Batangnya panjang, tegap dan berwarna putih kehijauan, daunnya berwarna hijau yang lebar, pipih, halus, tidak berbulu, dan tidak berkrop sedangkan tangkai daunnya berwarna putih kehijauan ', 'kalori : 13 kkal.\r\nlemak : 0,2 g.\r\nkarbohidrat : 2,2 g.\r\nsodium : 65 mg.\r\nkalium : 252 mg.\r\n', 'Sawi memiliki kandungan vitamin dan zat gizi yang penting bagi kesehatan, sawi dipercya dapat menghilangkan rasa gatal di tenggorokan pada penderita batuk. Sawi juga berfungsi sebagai penyembuh sakit kepala, bahan pembersih darah. Penyakit ginjal dianjurkan untuk banyak mengkonsumsi sawi karena dapat memperbaiki fungsi kerja ginjal. Sawi juga baik untuk memperlancar pencernaaan dan sebagai obat penyakit obat penyakit panas dalam ', 'kindom : Plantae\r\ndivisi:Spermatophyta\r\nkelas : Dicotylodenae\r\nordo : Rhoeadales\r\nfamili : Cruciferae\r\ngenus : Brassica\r\nspesies : Brassica chinensis L.', '', NULL, '2019-10-02 15:47:53', '2019-09-07 18:42:22', 1, 1),
('05-01-20185a4f3b5a2e1b8', 'sayur', 'Daun Pepaya', 'Daun Pepaya(Carica papaya L.)', 'Tanaman ini berasal dari Amerika (Steenis, 2005). Daun pepaya termasuk kedalam kelas Dicotyledonae. Daunnya menjari dan berwarna hijau tua  dengan tulang daun yang berwarna putih, tangkainya berwarna hijau muda dengan lubang seperti pipa, tangkainya kurang lebih 15 cm untuk daun yang sudah tua ', 'kilojoule : 230 kj.\r\nkalori : 55 kkal.\r\nlemak : 0,2 g.\r\nprotein : 0,85 g.\r\nkarbohidrat : 13,73 g.\r\nsodium : 4 mg.\r\nkalium : 360 mg.\r\n', 'Selain enzim papain pepaya juga megandung alkaloid karpaina, pseudo karpaina, glikosid, karposid, dan saponin. Kompleksnya senyawa ini menjadikan khasiat daun pepaya juga ikut beragam. Untuk mendapatkan manfaat tersebut, daun pepaya biasanya diolah. Khusus untuk ekstrak daun pepaya, banyak diistimewakan sebab bisa digunakan dari dalam maupun luar dan tak hanya untuk kesehatan manusia saja tetapi untuk pertanian, perikanan dan lain-lain ', 'kindom : Plantae\r\ndivisi:Spermatophyta\r\nkelas : Dicotyledonae\r\nordo : Caricales\r\nfamili : Caricaceae (Labiatae)\r\ngenus : Carica\r\nspesies : Carica papaya L', 'sub_kindom : Tracheobionta\r\nsub_divisi : Angiospermae\r\n', NULL, '2019-10-03 10:22:00', '2019-09-07 18:42:22', 1, 1),
('05-01-20185a4f3b70e48de', 'buah', 'Jeruk Kino', 'Jeruk Kino (Citrus sinensis)', 'Jeruk kino merupakan buah impor. Buah ini digolongkan sebagai buah sejati tunggal berdaging. Kulit luar buah berwarna orange dan daging buah berwarna orange (Kanisius, 2011). Dari empat kecamatan yang dijadikan sampel, jeruk kino ditemuakan di Kecamatan Tanggul, Kaliwates, Ambulu, dan Balung.', '-', '-', 'kindom : Plantae\r\ndivisi:Spermatophyta\r\nkelas : Dicotyledonae\r\nordo : Rutales\r\nfamili : genus\r\ngenus : Citrus\r\nspesies : Citrus lemon, Citrus sinensis', '', NULL, '2019-10-02 21:03:04', '2019-09-07 18:42:22', 1, 1),
('05-01-20185a4f3b96548b9', 'buah', 'Kiwi ', '1.	Kiwi Hijau ', '1.	Kiwi Hijau\r\nBuah kiwi hijau merupakan buah impor. Buah ini digolongkan sebagai buah sejati tunggal berdaging. Kulit luar buah berwarna coklat dan daging buah berwarna hijau (Ide, 2010). Dari empat kecamatan yang dijadikan sampel, buah kiwi hijau hanya ditemuakan di Kecamatan Kaliwates.\r\n', '-', '-', 'kindom : Plantae\ndivisi:Magnoliophyta\nkelas : Magnoliopsida\nordo : Theales\nfamili : Actinidiaceae\ngenus : Actinidia\nspesies : Actinidia chinensis ', '', NULL, '2019-09-07 20:42:22', '2019-09-07 18:42:22', 1, 1),
('05-01-20185a4f3bc363173', 'sayur', 'Daun Kelor ', 'Daun Kelor (Moringa oleifera Lam.)', 'Tanaman kelor mulai dimanfaatkan sekitar 2000 tahun SM atau 5000 tahun silam di india utara. Stuktur morfologi tanaman kelor terdiri atas akar, batang, daun, bunga, buah dan biji. Daunnya majemuk, betangkai panjang, tersusun berseling dan beranak daun. Helai daun saat muda berwarna hijau muda, tetapi setelah dewasa menjadi hijau tua. Bentuk helai daun bulat telur, panjang 1-2 cm, lebar 1-2 cm, tipis lemas, ujung dan pangkal tumpul, tepi rata, susunan pertulangan mnyirip, permukaan atas dan bawah halus. Tangkai daun berbentuk silinder dengan sisi atas agak pipih. Buah berbentuk segi tiga memanjang yang disebut klentang dengan panjang 20-60 cm ', 'Energi : 82 kkal.\r\nProtein : 6,7 gr.\r\nLemak : 1,7 gr.\r\nKarbohidrat : 14,3 gr.\r\nKalsium : 440 mg.\r\nJosfor : 70 mg.\r\nZat Besi : 7 mg.\r\nVitamin A : 11300 IU.\r\nVitamin B1 : 0,21 mg.\r\nVitamin C : 220 mg.', 'Kelor kaya akan kandungan nutrisi dan senyawa yang dibutuhkan tubuh. Sluruh bagian tanaman dapat dimanfaatkan untuk penyembuhan, Ilmu pengetahuan mencatat bahwa tanaman kelor mengandung 46 antioksidan, 36 antiinflamasi, 18 asam amino, 90 nutrisi, vitamin, mineral, phytonutrien, konsentrasi tinggi zeatin, seta mengandung zat nongizi. Daun kelor digunakan untuk penurunan tekanan darah tinggi, diare, kencing manis, dan penyait jantung, pengobatan malaria, mengurangi rasa sakit, penurunan tekanan darah tinggi ', 'kindom : Plantae\r\ndivisi:Spermatophyta\r\nkelas : Magnoliopsida\r\nordo : Capparales\r\nfamili : Moringaceae\r\ngenus : Moringa\r\nspesies : Moringa oleifera Lam. ', 'sub_kindom : Tracheobionta\r\n', NULL, '2019-10-02 14:58:53', '2019-09-07 18:42:22', 1, 1),
('05-01-20185a4f3bd036d60', 'buah', 'Jeruk (Citrus Sp.)', 'Jeruk Lemon (Citrus lemon) ', 'Jeruk lemon merupakan buah impor. Buah ini digolongkan sebagai buah sejati tunggal berdaging. Kulit luar buah berwarna kuning dan daging buah berwarna kuning (Kanisius, 2011). Dari empat kecamatan yang dijadikan sampel, jeruk lemon ditemuakan di Kecamatan Kaliwates.', '-', '-', 'kindom : Plantae\ndivisi:Spermatophyta\nkelas : Dicotyledonae\nordo : Rutales\nfamili : genus\ngenus : Citrus\nspesies : Citrus lemon, Citrus sinensis', '', NULL, '2019-09-07 20:42:22', '2019-09-07 18:42:22', 1, 1),
('05-01-20185a4f3bd8c7f9b', 'buah', 'Kiwi', '2.	Kiwi Kuning ', '2.	Kiwi Kuning \r\nBuah kiwi kuning merupakan buah impor. Buah ini digolongkan sebagai buah sejati tunggal berdaging. Kulit luar buah berwarna coklat dan daging buah berwarna kuning (Ide, 2010). Dari empat kecamatan yang dijadikan sampel, buah kiwi  kuning hanya ditemuakan di Kecamatan Kaliwates.\r\n', '-', '-', 'kindom : Plantae\ndivisi:Magnoliophyta\nkelas : Magnoliopsida\nordo : Theales\nfamili : Actinidiaceae\ngenus : Actinidia\nspesies : Actinidia chinensis', '', NULL, '2019-09-07 20:42:22', '2019-09-07 18:42:22', 1, 1),
('05-01-20185a4f3be614792', 'sayur', 'Jonggolan', 'Jonggolan(Erechtites valerianifolia Raf.)', 'Tanaman ini berasal dari Afrika Tropis yang kemudian menyebar ke seluruh daerah beriklim tropis di Asia (Syah, 2014) Tumbuhan jonggolan memiliki batang yang lunak dan beralur dangkal. Daun warna hijau dan terletak tersebar dengan tangkai yang bertelinga. Helaian daun berbentuk jorong memanjang atau bundar telur terbalik, ukuran daun kurang lebih 8 cm, pangkal daun menyempit disepanjang tangkai daun, ujung daun runcing, berlekuk hingga menyirip, bergerigi kasar runcing, permukaan daun berbulu halus dan rapat. Daun yang paling atas lebih kecil dari pada bentuk daun yang ada di bawah ', 'caryophyllene (10,29%).\r\ncubebene (13,77%).\r\nfarnesene (13,27%).\r\ntimol (43,93%).\r\naryophyllene (15.16%).\r\ncyclohexybutyramide (20,94%).', 'Junggulan (Erechtites valerianifolia Raf.) mempunyai banyak sekali manfaatnya yaitu mencegah radang, mencegah sembelit, meningkatkan nafsu makan, mengobati sakit kepala, mengobati kram perut, menambah daya tahan tubuh, menambah energy, mengobati sakit peut karena susah BAB, menurunkan demam. mengobati pilek, mengandung vitamin D dan K, mencegah penyakit tifus, melembutkan kulit wajah, mencegah penuaan dini dan sebagai herbal aromaterapi ', 'kindom : Plantae\r\ndivisi:Magnoliophyta\r\nkelas : Magnoliopsida\r\nordo : Asterales\r\nfamili : Asteraceae\r\ngenus : Erechtiles\r\nspesies : Erechtites valerianifolia Raf', '', NULL, '2019-10-02 14:47:33', '2019-09-07 18:42:22', 1, 1),
('05-01-20185a4f3c3ee28c4', 'sayur', 'Daun Singkong', 'Daun Singkong(Manihot esculenta)', 'Tanaman ini berasal dari Amerika tropis (Steenis, 2005). Daun singkong termasuk kedalam kelas Dicotyledonae. Daunnya menjari dengan warna daunnya yang ada 2 yaitu hijau tua dan hijau muda, tulang daunnya berwarna putih kehijauan sedangkan tangkai daunnya berwarna pink dan batangnya berwarna hijau kecokelatan ', 'kilojoule : 159 kj.\r\nkalori : 38 kkal.\r\nlemak : 0,29 g.\r\nprotein : 3,66 g.\r\nkarbohidrat : 7,25 g.\r\nsodium : 10 mg.\r\nkalium : 478 mg.\r\n', 'Pucuknya serta daunnya yang masih muda dan lunak mengandung protein, lemak, karbohidrat, vitamin A dan B1, dapat dipergunakan sebagai makanan ternak (kambing, sapi, ulat sutera dan lain-lain) setelah layu. Daun ketela pohon/singkong yang baru dipetik mengandung banyak Asam Hidrocyan (HCN) sehingga beracun. Karena itu, sebelum dikonsumsi daun ketela pohon/singkong harus dilayukan terlebih dahulu atau direndam untuk mengurangi kadar racun HCNnya', 'kindom : Plantae\r\ndivisi:Spermatophyta\r\nkelas : Dicotylodenae\r\nordo : Euphorbiales\r\nfamili : Euphorbiaceae\r\ngenus : Manihot\r\nspesies : Manihot esculenta', 'sub_divisi : Angiospermae\r\n', NULL, '2019-10-03 10:21:41', '2019-09-07 18:42:22', 1, 1),
('05-01-20185a4f3c4077645', 'buah', 'Pear ', '1.	Pear Century (Pyrus pyrifolia)', '1.	Pear Century (Pyrus pyrifolia)\r\nPear  century merupakan buah impor. Buah ini digolongkan sebagai buah sejati tunggal berdaging. Kulit luar buah berwarna kuning dan daging buah berwarna putih (Communication, 2005). Dari empat kecamatan yang dijadikan sampel, buah pear century  dijual di Kecamatan Kaliwates dan Ambulu \r\n', '-', '-', 'kindom : Plantae\ndivisi:Magnoliophyta\nkelas : Magnoliopsida\nordo : Rosales\nfamili : Rosaceae\ngenus : Pyrus\nspesies : Pyrus sp. ', '', NULL, '2019-09-07 20:42:22', '2019-09-07 18:42:22', 1, 1),
('05-01-20185a4f3c62e09be', 'sayur', 'Kangkung Darat', 'Kangkung Darat (Ipomea reptans Poir)', 'Tanaman ini berasal dari India yang menyebar ke Malaysia, Birma, Indonesia, Cina selatan, Australia, dan Afrika (Sunarjono, 2016). Kangkung termasuk kedalam sayuran Convolvulaceae. Kangkung bisa ditanaman tanah yang subur dan ditanam ditempat yang agak kering. Kangkung darat daunnya panjang, berujung runcing dan berwarna hijau keputih-putihan. Daun, batang dan tangkai daun kangkung darat semua berwarna hijau sedangkan akarnya berwarna putih. Dalam batang kangkung terdapat lubang kecil bentuknya seperti pipa', 'kilojoule : 84 kj.\r\nkalori : 20 kkal.\r\nlemak : 0,34 g.\r\nprotein : 2,51 g.\r\nkarbohidrat : 3,18 g.\r\nsodium : 69 mg.\r\nkalium : 489 mg.\r\n', 'Kangkung berfungsi sebagai obat tidur karena dapat menenangkan saraf. Akarnya penting untuk obat wasir (haemorrhoid). Sementara itu zat besi yang tekandung dalam kangkung sangat berguna untuk pertumbuhan badan', 'kindom : Plantae\r\ndivisi:Magnoliophyta\r\nkelas : Magnoliopsida\r\nordo : Solanales\r\nfamili : Convolvulaceae\r\ngenus : Ipomea\r\nspesies : Ipomea reptans Poir', 'sub_kindom : Tracheobionta\r\nsub_divisi : Spermatophyta\r\nsub_kelas : Asteridae\r\n', NULL, '2019-10-03 10:22:59', '2019-09-07 18:42:22', 1, 1),
('05-01-20185a4f3c8c25325', 'buah', 'Pear', '2.	Pear Golden (Pyrus pyrifolia)', '2.	Pear Golden(Pyrus pyrifolia)\r\nPear golden merupakan buah impor. Buah ini digolongkan sebagai buah sejati tunggal berdaging. Kulit luar buah berwarna kuning dan daging buah berwarna putih (Communication, 2005). Dari empat kecamatan yang dijadikan sampel, buah pear  golden hanya di Kecamatan Kaliwates, Ambulu dan Balung.   \r\n', '-', '-', 'kindom : Plantae\ndivisi:Magnoliophyta\nkelas : Magnoliopsida\nordo : Rosales\nfamili : Rosaceae\ngenus : Pyrus\nspesies : Pyrus sp.', '', NULL, '2019-09-07 20:42:22', '2019-09-07 18:42:22', 1, 1),
('05-01-20185a4f3c9f1cea9', 'buah', 'Jeruk Navel', 'Jeruk Navel (Citrus sinensis)', 'Jeruk nevel merupakan buah impor. Berdasarkan golongan buah, Jeruk nevel termasuk buah sejati tunggal berdaging. Kulit luar buah berwarna orange dan daging buah berwarna orange (Kanisius, 2011). Dari empat kecamatan yang dijadikan sampel, jeruk nevel ditemuakan di Kecamatan Kaliwates. ', '-', '-', 'kindom : Plantae\r\ndivisi:Spermatophyta\r\nkelas : Dicotyledonae\r\nordo : Rutales\r\nfamili : Rutaceae\r\ngenus : Citrus\r\nspesies : Citrus lemon, Citrus sinensis', '', NULL, '2019-10-02 21:05:04', '2019-09-07 18:42:22', 1, 1),
('05-01-20185a4f3cb4964f7', 'sayur', 'Genjer', 'Genjer (Limnocharis flava)', 'Tanaman ini berasal dari Amerika tropis (amerika tengah dan selatan (Chaidir, 2016). Genjer (Limnocharis flava) termasuk kedalam kelas Liliopsida. Genjer memiliki daun yang berwarna hijau dengan buah yang kecil dan berwarna hijau serta tangkai daunnya berwarna cokelat kehijauan, di dalam tangkai daunnya seperti gabus dan berwarna putih. Terdapat bunga disela daunnya, bunganya berwarna kuning kunyit ', 'kalori : 39 kkal.\r\nzat besi : 2,1 mg.\r\nprotein : 1,7 g.\r\nkarbohidrat : 7,7 g.\r\nfosfor : 33 mg.\r\nkalsium : 62 mg.\r\n', 'Genjer mengandung gizi cukup lengkap dari protein, lemak, karbohidrat, mineral dan vitamin.  Genjer juga mempunyai banyak manfaat yaitu sebagai obat penambah nafsu makan, peremajaan sel-sel tubuh, cadangan energy, memperkuat tulang, mencegah kanker kolon dan sembelit, mengurangi resiko penyakit jantung dan kanker, mengatasi anemia, sebagai obat anti kuman alami, dan baik untuk ibu hamil ', 'kindom : Plantae\r\ndivisi:Magnoliophyta\r\nkelas : Liliopsida\r\nordo : Alismatales\r\nfamili : Alismataceae\r\ngenus : Limnocharis\r\nspesies : Limnocharis flava', '', NULL, '2019-10-02 14:49:31', '2019-09-07 18:42:22', 1, 1),
('05-01-20185a4f3cc259391', 'sayur', 'Kenikir', 'Kenikir(Cosmos caudatus)', 'Kenikir atau ulam raja merupakan tumbuhan tropis yang berasal dari Amerika Latin, Amerika Tengah (Fita, 2015). Kenikir mempunyai nama ilmiah Cosmos caudatus Kunth. termasuk ke dalam keluarga Asteracae, masih satu keluarga dengan bunga matahari, krisan, atau herbras. Kenikir memiliki batang bulat, tumbuh tegak, dan bercabang-cabang. Tinggi tumbuhan ini berkisar antara 30 cm hingga 120 cm. Memiliki daun majemuk menyirip ganda, yang ujung anak daunnya runcing, memiliki warna hijau tua. Bunga kenikir mempunyai bunga majemuk, berbentuk cawan dengan tangkai yang panjang, seperti pada bunga matahari, hanya diameternya lebih kecil antara 2 - 5 cm ', 'kilojoule : 113 kj.\r\nkalori : 27 kkal.\r\nlemak : 0,61 g.\r\nprotein : 2,54 g.\r\nkarbohidrat : 4,34 g.\r\nsodium : 4 mg.\r\nkalium : 462 mg.\r\n', 'Kenikir berkhasiat sebagai penambah nafsu makan, lemah lambung, penguat lambung, dan juga dapat digunakan sebagai pengusir serangga. Selain itu berdasarkan penelitian, daun kenikir mengandung antioksidan yang dapat mengurangi resiko penyakit kanker', 'kindom : Plantae\r\ndivisi:Spermatophyta\r\nkelas : Magnoliophyta\r\nordo : Fabales\r\nfamili : Asteraceae\r\ngenus : Cosmos\r\nspesies : Cosmos caudatus', '', NULL, '2019-10-03 10:23:31', '2019-09-07 18:42:22', 1, 1),
('05-01-20185a4f3cdd9d3b2', 'buah', 'Pear', '3.	Pear Packham (Pyrus bretschneideri)', '3.	Pear Packham (Pyrus bretschneideri)\r\nPear packham merupakan buah impor. Buah ini digolongkan sebagai buah sejati tunggal berdaging. Kulit luar buah berwarna hijau dan daging buah berwarna putih (Communication, 2005). Dari empat kecamatan yang dijadikan sampel, buah pear  packham hanya dijual di Kecamatan Kaliwates.  \r\n', '-', '-', 'kindom : Plantae\ndivisi:Magnoliophyta\nkelas : Magnoliopsida\nordo : Rosales\nfamili : Rosaceae\ngenus : Pyrus\nspesies : Pyrus sp.', '', NULL, '2019-09-07 20:42:22', '2019-09-07 18:42:22', 1, 1),
('05-01-20185a4f3d1e13b3f', 'buah', 'Pear', '4.	Pear Singo RRC (Pyrus pyrifolia)', '4.	Pear Singo RRC (Pyrus pyrifolia)\r\nPear singo RRC merupakan buah impor. Buah ini digolongkan sebagai buah sejati tunggal berdaging. Kulit luar buah berwarna coklat dan daging buah berwarna putih (Communication, 2005). Dari empat kecamatan yang dijadikan sampel, buah pear singo RRC hanya dijual di Kecamatan Kaliwates.  \r\n', '-', '-', 'kindom : Plantae\ndivisi:Magnoliophyta\nkelas : Magnoliopsida\nordo : Rosales\nfamili : Rosaceae\ngenus : Pyrus\nspesies : Pyrus sp.', '', NULL, '2019-09-07 20:42:22', '2019-09-07 18:42:22', 1, 1),
('05-01-20185a4f3d250cf6e', 'buah', 'Lengkeng (Dimocarpus longan)', 'Lengkeng (Dimocarpus longan)', 'Buah lengkeng merupakan buah impor. Buah ini digolongkan sebagai sejati tunggal berdaging. Kulit luar buah berwarna coklat dan daging buah berwarnaputih bening. Dari empat kecamatan yang dijadikan sampel, lengkeng ditemuakan di Kecamatan Tanggul, Kaliwates, Ambulu, dan Balung.', '-', '-', 'kindom : Plantae\ndivisi:Magnoliopsyta\nkelas : Magnoliopsida\nordo : Sapindales\nfamili : Sapindaceae \ngenus : Dimocarpus \nspesies : Dimocarpus longan', '', NULL, '2019-09-07 20:42:22', '2019-09-07 18:42:22', 1, 1),
('05-01-20185a4f3d2a7d96e', 'sayur', 'Kangkung Air ', 'Kangkung Air (Ipomea aquatic)', 'Berasal dari India yang menyebar ke Malaysia, Birma, Indonesia, Cina selatan, Australia, dan Afrika (Sunarjono, 2016). Kangkung air ini juga termasuk kedalam sayuran Convolvulaceae. Sayuran bisa tumbuh didaerah pinggir-pinggir kolam dan rawa. Kangkung air berdaun panjang, tetapi ujungnya agak tumpul dan berwarna hijau kelam. Tangkainya berwarna hijau dengan  batang yang berwarna cokelat keunguan, didalamnya juga terdapat lubang kecil seperti pipa', 'kilojoule : 84 kj.\r\nkalori : 20 kkal.\r\nlemak : 0,34 g.\r\nprotein : 2,51 g.\r\nkarbohidrat : 3,18 g.\r\nsodium : 69 mg.\r\nkalium : 489 mg.\r\n', 'Kangkung memiliki  sejumlah zat penting seperti vitamin A, C, dan B kompleks, kalsium, fosfor, dan zat besi. Kangkung berfungsi sebagai obat tidur karena dapat menenangkan saraf. Akarnya penting untuk obat wasir (haemorrhoid). Sementara itu zat besi yang tekandung dalam kangkung sangat berguna untuk pertumbuhan badan ', 'kindom : Plantae\r\ndivisi:Spermatophyta\r\nkelas : Dicotylodenae\r\nordo : Convolvulales\r\nfamili : Convolvulacae\r\ngenus : Ipomea\r\nspesies : Ipomea aquatic', 'sub_divisi : Angiospermae\r\n', NULL, '2019-10-03 10:22:40', '2019-09-07 18:42:22', 1, 1),
('05-01-20185a4f3d2bf3493', 'sayur', 'Pakis', 'Pakis(Diplazium esculentum)', 'Tumbuhan paku tersebar di seluruh bagian dunia, kecuali daerah bersalju abadi dan lautan, dengan kecenderungan ditemukan tumbuh di tempat-tempat yang tidak subur untuk pertanian (Zakiyyah, 2016). Pakis termasuk ke dalam kelas Pteridopsida. Daunnya berwarna hijau dengan tangkai daun  dan batangnya berwarna hijau. Sedangkan bakal daunnya berwarna hijau ada yang berwarna kecokelatan dan terdapat bulu-bulu halus pada batangnya', 'kilojoule : 35 kj.\r\nkalori : 35 kkal.\r\nlemak : 0,3 g.\r\nprotein : 4 g.\r\nkarbohidrat : 6,4 g.\r\nfosfor : 172 mg.\r\nkalsium : 42 mg.\r\nzat besi : 1 mg.\r\nvitamin a : 2881 iu.\r\nvitamin b1 : 0 mg.\r\nvitamin c : 30 mg.\r\n', 'Manfaat sayur pakis bagi kesehatan yaitu menjaga system kekebalan tubuh, melancarkan proses metabolisme, mencegah penyakit rematik, menjaga kesehatan tulang, mencegah penuaan dini, mengatasi hipertensi atau tekanan darah tinggi, pengendalian hama atau pestisida alami, melancarkan buang air besar, melancarkan peredaran darah dan meningkatkan daya ingat', 'kindom : Plantae\r\ndivisi:Pteridophyta\r\nkelas : Pteridopsida\r\nordo : Athyriales\r\nfamili : Athyriaceae\r\ngenus : Diplazium \r\nspesies : Diplazium esculentum', '', NULL, '2019-10-03 10:24:15', '2019-09-07 18:42:22', 1, 1),
('05-01-20185a4f3d6828065', 'buah', 'Pear', '5.	Pear Xiang Lie (Pyrus sinkiangensis)', '5.	Pear Xiang Lie (Pyrus sinkiangensis)\r\nPear Xiang Lie  merupakan buah impor. Buah ini digolongkan sebagai buah sejati tunggal berdaging. Kulit luar buah berwarna hijau dan daging buah berwarna putih (Communication, 2005). Dari empat kecamatan yang dijadikan sampel, buah pear xiang lie  hanya dijual di Kecamatan Kaliwates.  \r\n', '-', '-', 'kindom : Plantae\ndivisi:Magnoliophyta\nkelas : Magnoliopsida\nordo : Rosales\nfamili : Rosaceae\ngenus : Pyrus\nspesies : Pyrus sp.', '', NULL, '2019-09-07 20:42:22', '2019-09-07 18:42:22', 1, 1),
('05-01-20185a4f3d9dba096', 'sayur', 'Selada Air', 'Selada Air (Nasturtium spp.)', 'Berasal dari Eropa dan Asia (Sa’adah, 2015). Selada air (Nasturtium spp) termasuk kedalam family Cruciferae (Brassicaceae). Daun yang terdapat pada selada air berwarna hijau muda dan hijau tua, bentuknya kecil seperti ujung jari, tangkainya panjang dan berwarna putih serta  mudah patah. Di bagian sela-sela daun terdapat sedikit rambut-rambut akar', 'kilojoule : 4 kj.\r\nkalori : 1 kkal.\r\nlemak : 0,01 g.\r\nprotein : 0,07 g.\r\nkarbohidrat : 0,24 g.\r\nsodium : 1 mg.\r\nkalium : 11 mg.\r\n', 'Selada air mempunyai kandugan vitamin C dan K, Kalsium, serat, zat besi dan asam folat. Selada air juga  bermanfaat untuk melindungi berat tubuh, mencegah terjadinya kanker, meredakan sakit kepala, menghindarkan, meningkatkan kesehatan hati, dan  mencegah rambut rontok ', 'kindom : Plantae\r\ndivisi:Magnoliophyta\r\nkelas : Magnoliopsida\r\nordo : Capparales\r\nfamili : Brassicaceae/ Cruciferae\r\ngenus : Nasturtium\r\nspesies : Nasturtium spp', '', NULL, '2019-10-03 10:25:31', '2019-09-07 18:42:22', 1, 1),
('05-01-20185a4f3db50b502', 'buah', 'Pear', '6.	Pear Ya lie (Pyrus bretschneideri)', '6.	Pear Ya lie (Pyrus bretschneideri)\r\nPear Ya Lie  merupakan buah impor. Buah ini digolongkan sebagai buah sejati tunggal berdaging. Kulit luar buah berwarna kuning dan daging buah berwarna putih (Communication, 2005). Dari empat kecamatan yang dijadikan sampel, buah Pear Ya Lie  hanya dijual di Kecamatan Tanggul dan Kecamatan Kaliwates.  \r\n', '-', '-', 'kindom : Plantae\ndivisi:Magnoliophyta\nkelas : Magnoliopsida\nordo : Rosales\nfamili : Rosaceae\ngenus : Pyrus\nspesies : Pyrus sp.', '', NULL, '2019-09-07 20:42:22', '2019-09-07 18:42:22', 1, 1),
('05-01-20185a4f3db612e55', 'sayur', 'Kemangi', 'Kemangi (Ocimum sanctum L.) ', 'Spesies ini banyak terdapat di Asia dan Amerika (Ridwan, 2016). Kemangi daunnya berwarna hijau muda, daunnya tersusun dalam bentuk pasangan yang bertentangan dan tersusun dari arah atas dan bawah. Letak daunnya tersusun dalam bentuk pasangan yang bertentangan dan tersusun dari arah atas dan bawah. Tangkai daun berwarna hijau dan panjangnya antara 0,5 â€“ 2 cm, helian daun berbentuk bulat telur, ujung nhhya meruncing, tampak menggelombang, pada sebelah daun terdapat 3 â€“ 6 tulang. Tepi daun sedikit berigi, terdapat bintik â€“ bintik serupa kelenjar. Daun pelindung elips atau bulat telur, panjang antara 0,5 â€“ 1 cm. Batangnya berbentuk empat segi dan mempunyai bulu-bulu halus. Bunga kemangi tersusun pada tangkai bunga yang berbentuk menegak ', 'kilojoule : 4 kj.\r\nkalori : 1 kkal.\r\nlemak : 0,03 g.\r\nprotein : 0,13 g.\r\nkarbohidrat : 0,23 g.\r\nsodium : 0 mg.\r\nkalium : 24 mg.\r\n', 'Khasiat daun kemangi sangat baik untuk melawan radikal bebas, mencegah pertumbuhan bakteri, virus dan jamur. Kemangi juga bermanfaat untuk membantu pertumbuhan tulang, melancarkan aliran darah, meningkatkan kekebalan tubuh, mencegah kemandulan, mengobati panu, mengobati sariawan dan menghilangkan bau mulut ', 'kindom : Plantae\r\ndivisi:Spermatophyta\r\nkelas : Dicotylodenae\r\nordo : Tubiflorae \r\nfamili : Labiate (Lamiaceae)\r\ngenus : Ocimum L.\r\nspesies : Ocimum sanctum L. ', 'sub_divisi : Angiospermae\r\nsub_kelas : Asteridae\r\n', NULL, '2019-10-03 10:23:16', '2019-09-07 18:42:22', 1, 1),
('05-01-20185a4f3ddb063a6', 'buah', 'Persimmon(Diospyros kaki)', 'Persimmon(Diospyros kaki)', 'Persimmon merupakan buah impor. Buah ini digolongkan sebagai buah sejati tunggal berdaging. Kulit luar buah berwarna orange dan daging buah juga berwarna orange (Wirakusumah, 2007). Dari empat kecamatan yang dijadikan sampel, buah persimmon hanya dijual di Kecamatan Kaliwates.  ', '-', '-', 'kindom : Plantae\ndivisi:Magnoliopsyta\nkelas : Magnoliopsida\nordo : Ebenales\nfamili : Ebenaceae\ngenus : Diospyros\nspesies : Diospyros kaki ', '', NULL, '2019-09-07 20:42:22', '2019-09-07 18:42:22', 1, 1),
('05-01-20185a4f3e04eff7e', 'sayur', 'Selada Daun', 'Selada Daun (Lactuca sativa L.)', 'Berasal dari lembah dari bagian timur laut tengah (Sunarjono, 2016). Selada termasuk kedalam sayuran Compositae, bisa ditanam didataran rendah maupun dataran tinggi. Daunnya berwarna hijau dengannya ujungnya yang bergelombang dan bergerigi sedangkan warna pada tangkainya berwarna hijau muda ', '-', 'Daun tanaman selada mengandung vitamin A, B dan C yang bermanfaat bagi kesehatan (Sunarjono, 2004).Selada mengandung kalori, protein, lemak, karbohidrat, kalsium, fosfor, zat besi (Fe), vitamin A, vitamin B1, vitamin C dan air', 'kindom : Plantae\r\ndivisi:Spermatophyta\r\nkelas : Dicotyledoneae\r\nordo : Asterales\r\nfamili : Asteraceae\r\ngenus : Lactuca\r\nspesies : Lactuca sativa L', 'sub_divisi : Angiospermae\r\n', NULL, '2019-10-02 14:06:46', '2019-09-07 18:42:22', 1, 1),
('05-01-20185a4f3e20bd934', 'buah', 'Plum (Prunus domestica)', 'Plum (Prunus domestica)', 'Plum merupakan buah impor. Buah ini digolongkan sebagai buah sejati tunggal berdaging. Kulit luar buah berwarna ungu  dan daging buah juga berwarna kuning. (Wirakusumah, 2007) Dari empat kecamatan yang dijadikan sampel, buah plum hanya dijual di Kecamatan Kaliwates.  ', '-', '-', 'kindom : Plantae\ndivisi:Magnoliophyta\nkelas : Magnoliopsida\nordo : Rosales\nfamili : Rosaceae\ngenus : Prunus\nspesies : Prunus domestica', '', NULL, '2019-09-07 20:42:22', '2019-09-07 18:42:22', 1, 1),
('05-01-20185a4f3e4846028', 'sayur', 'Kubis', 'Kubis (Brassica oleraceae)', 'Tumbuh di sepanjang pantai laut tengah, pantai inggris, Denmark, dan sebelah utara Prancis barat (Sunarjono, 2016). Gubis termasuk ke dalam tanaman sayur Cruciferae (kubis-kubisan) yang memiliki cirri daun dan bunga yang berbentuk vas kembang. Kubis berdaun membentuk krop, daunnya menutup satu sama lain dan berwarna putih. Krop kubis putih tersebut padat dan besar', 'kilojoule : 100 kj.\r\nkalori : 24 kkal.\r\nlemak : 0,12 g.\r\nprotein : 1,44 g.\r\nkarbohidrat : 5,58 g.\r\nsodium : 18 mg.\r\nkalium : 246 mg.\r\n', 'Rebusan batang kubis dapat menekan penyakit prostat, sedangkan bunganya dapat mencegah penyakit kanker. Akan tetapi, jenis kubis putih tidak baik bila dimakan terlalu banyak oleh penderita wasir (hamorrhoid) ', 'kindom : Plantae\r\ndivisi:Spermatophyta\r\nkelas : Dicotylodenae\r\nordo : Rhoeadales\r\nfamili :  Cruciferae\r\ngenus : Brassica\r\nspesies : Brassica oleraceae var. botrytis. L.', 'sub_divisi : Angiospermae\r\n', NULL, '2019-10-03 10:23:59', '2019-09-07 18:42:22', 1, 1),
('05-01-20185a4f3e67e6da2', 'sayur', 'Bunga Kol', 'Bunga Kol (Brassica oleracea)', 'Tanaman ini berasal dari Eropa subtropis didaerah Mediterania (Rukmana, 1994). Bunga kol merupakan tamanan sayuran dengan nama spesies Brassica oleracea, family Brassicaceae. Tangkai daunnya agak panjang dan helai daunnya berlekuk-lekuk panjang. Bunga kol berdiameter antara 15-20 cm. Memiliki kepala bunga yang banyak dan teratur dengan padat dan berwarna putih kekuningan ', 'kilojoule : 105 kj.\r\nkalori : 25 kkal.\r\nlemak : 0,1 g.\r\nprotein : 1,98 g.\r\nkarbohidrat : 5,3 g.\r\nsodium : 30 mg.\r\nkalium : 303 mg.\r\n', 'Kembang kol adalah sumber vitamin C, folat, vitamin Kdan vitamin B-6, vitamin B1, B2, B3,E, mineral, sumber protein, dan mengandung jumlah lemak jenuh yang sangat rendah. Manfaat bunga kol yaitu kesehatan jantung, gangguan perut, kanker, kesehatan tulang, hipertensi dan kolesterol, system kekebalan tubuh dan obesitas', 'kindom : Plantae\r\ndivisi:Magnoliophyta\r\nkelas : Magnoliopsida\r\nordo : Brassicales\r\nfamili : Brassicaceae\r\ngenus : Brassica\r\nspesies : Brassica oleracea', '', NULL, '2019-10-03 10:26:27', '2019-09-07 18:42:22', 1, 1),
('05-01-20185a4f3ecb8657b', 'sayur', 'Bunga Turi', 'Bunga Turi (Sesbania grandiflora)', 'Tanaman ini asalnya diduga dari Asia Selatan dan Asia Tenggara, namun sekarang\r\ntelah tersebar ke berbagai daerah tropis dunia (Rukmana, 2016) Turi merupakan tanaman perdu yang batangnya tumbuh tegall setinggi 5-12 m, berdiameter antara 25-30 cn, dan ranting-rantingnya menggantung. Bunga turi berbentuk seperti kepala  atau paruh burung ketika kuncup, kemudian berubah menjadi bentuk kupu-kupu setelah mekar. Bunga berukuran besar dan tandan yang keluar dari ketiak daun, letaknya menggantung dengan 2-4 bunga dan bertangkai. Kuncup bunga berbentuk sabit, panjangnya 7-9 cm. Bunga berwarna putih, pink sampai meah muda dan merah ', 'kalori : 44 kkal.\r\nlemak : 0,6 g.\r\nprotein : 1,8 g.\r\nkarbohidrat : 9,6 g.\r\nfosfor : 29 mg.\r\nkalsium : 23 mg.\r\nbesi : 0,9 mg.\r\naktifitas vitamin a : 105 i.u.\r\ntiamin (vit b1) : 0,13 mg.\r\nasam askorbat (vitamin c) : 41 mg.\r\nair : 90,2%.', 'Bunga turi mengandung senyawa-senyawa nongizi yang memiliki sifat farmokologis tertentu. Bunga turi mengandung gizi (nutrisi) yang cukup tinggi dan sebagai obat pencahar ', 'kindom : Plantae\r\ndivisi:Magnoliophyta\r\nkelas : Magnoliopsida\r\nordo :  Fabales\r\nfamili : Fabaceae\r\ngenus : Sesbania\r\nspesies : Sesbania grandiflora', 'sub_famili : Faboideae\r\n', NULL, '2019-10-02 13:59:49', '2019-09-07 18:42:22', 1, 1),
('05-01-20185a4f3edb63e57', 'buah', 'Anggur', 'Anggur Calmeria', 'Anggur Calmeria\r\nAnggur Calmeria merupakan buah impor. Buah ini digolongkan sebagai buah sejati tunggal berdaging. Kulit luar buah berwarna hijau dan daging buah berwarna hijau bening (Sutiadi, 2007). Dari empat kecamatan yang dijadikan sampel, buah anggur calmeria ditemuakan di Kecamatan Kaliwates.\r\n', '-', '-', 'kindom : Plantae\ndivisi:-\nkelas : Magnoliopsida\nordo : Rhamnales\nfamili : Vitaceae\ngenus : Vitis\nspesies : Vitis vinifera', '', NULL, '2019-09-07 20:42:22', '2019-09-07 18:42:22', 1, 1),
('05-01-20185a4f3f1c3dfbb', 'sayur', 'Sawi Daging ', 'Sawi Daging (Brassica chinensis)', 'Tanaman ini berasal dari Cina selatan dan Cina pusat serta Taiwan (Sunarjono, 2016). Sawi termasuk ke dalam sayuran Cruciferae yaitu tanaman kubis-kubisan. Daun sawi berdaun lonjong, halus, tidak berbulu, tidak berkrop dan berwarna hijau muda. Batang yang terdapat pada sawi yaitu batangnya pendek sedangkan tangkainya pendek dan berwarna putih serta urat daunnya sempit dengan tulang daun berwarna putih', 'kilojoule : 46 kj.\r\nkalori : 11 kkal.\r\nlemak : 0,15 g.\r\nprotein : 0,88 g.\r\nkarbohidrat : 2,05 g.\r\nsodium : 7 mg.\r\nkalium : 61 mg.\r\n', 'Sawi baik untuk Ibu Hamil, khasiat sawi luar biasa, mampu menangkal hipertensi, penyakit jantung, dan berbagai jenis kanker. Manfaat lainnya adalah menghindarkan ibu hamil dari anemia ', 'kindom : Plantae\r\ndivisi:Spermatophyta\r\nkelas : Dicotylodenae\r\nordo : Rhoeadales (Brassicales)\r\nfamili : Cruciferae (Brassicaceae)\r\ngenus : Brassica\r\nspesies : Brassica chinensis', 'sub_divisi : Angiospermae\r\n', NULL, '2019-10-03 10:24:31', '2019-09-07 18:42:22', 1, 1),
('05-01-20185a4f3f2fb2775', 'buah', 'Anggur', 'Anggur Red Globe', 'Anggur Red Globe\r\nAnggur red globe merupakan buah impor. Buah ini digolongkan sebagai buah sejati tunggal berdaging. Kulit luar buah berwarna merah dan daging buah berwarna putih bening (Sutiadi, 2007). Dari empat kecamatan yang dijadikan sampel, buah anggur red globe ditemuakan di Kecamatan Tanggul, kaliwates, Ambulu, dan Balung. \r\n', '-', '-', 'kindom : Plantae\ndivisi:-\nkelas : Magnoliopsida\nordo : Rhamnales\nfamili : Vitaceae\ngenus : Vitis\nspesies : Vitis vinifera', '', NULL, '2019-09-07 20:42:22', '2019-09-07 18:42:22', 1, 1),
('05-01-20185a4f3f367b241', 'sayur', 'Talas', 'Talas (Colocasia esculenta)', 'Asal mula tanaman ini berasal dari daerah Asia Tenggara, menyebar ke China dalam abad pertama, ke Jepang, ke daerah Asia Tenggara lainnya dan ke beberapa pulau di Samudra Pasifik, terbawa oleh migrasi penduduk (Prasetyajati, 2015). Talas termasuk ke dalam kelas Liliopsida dengan nama latin Colocasia esculenta. Batang talas terbungkus oleh pelepah daun dan berbentuk umbi. Batang talas berwarna cokelat agak kehitaman dan terdapat bulu-bulu halus. Batangnya berbentuk bulat dan jarak antar ruas batang sangat sempit atau pendek', 'kilojoule : 469 kj.\r\nkalori : 112 kkal.\r\nlemak : 0,2 g.\r\nprotein : 1,5 g.\r\nkarbohidrat : 26,46 g.\r\nsodium : 11 mg.\r\nkalium : 591 mg.', 'Talas dari mulai daun dan umbinya mempunyai kandungan gizi yang cukup baik. Talas mengandung unsur mineral dan vitamin, sehingga dapat dijadikan obat-obatan, umbi talas juga berpotensi sebagai sumber karbohidrat dan protein yang cukup tinggi. Umbi talas juga mengandung lemak, vitamin A, B1 dan sedikit\r\nvitamin C \r\n', 'kindom : Plantae\r\ndivisi:Magnoliophyta\r\nkelas : Liliopsida\r\nordo : Alismatales\r\nfamili : Araceae\r\ngenus : Colocasia\r\nspesies : Colocasia esculenta', '', NULL, '2019-10-03 10:27:04', '2019-09-07 18:42:22', 1, 1),
('05-01-20185a4f3f7212810', 'buah', 'Anggur', 'Anggur Thomson ', 'Anggur Thomson\r\nAnggur thomson merupakan buah impor. Buah ini digolongkan sebagai buah sejati tunggal berdaging. Kulit luar buah berwarna hijau dan daging buah berwarna hijau bening (Sutiadi, 2007). Dari empat kecamatan yang dijadikan sampel, buah anggur thomson ditemuakan di Kecamatan Kaliwates \r\n', '-', '-', 'kindom : Plantae\ndivisi:-\nkelas : Magnoliopsida\nordo : Rhamnales\nfamili : Vitaceae\ngenus : Vitis\nspesies : Vitis vinifera', '', NULL, '2019-09-07 20:42:22', '2019-09-07 18:42:22', 1, 1),
('05-01-20185a4f3f88ccdb6', 'sayur', 'Seledri', 'Seledri (Apium graveolens L.)', 'Tumbuhan herbal bernama seledri ini berasal dari daerah subtrotip Eropa dan Asia (Sunanto, 2009). Seledri termasuk kedalam sayuran Umbelliferae, seledri bisa hidup didataran rendah maupun tinggi terutama pada daerah yang sejuk. Daunnya menjari, melekuk-lekuk, tidak teratur dan berwarna hijau tua, tangkai seledri juga berwarna hijau tua serta bentuknya panjang sedangkan batangnya berwarna hijau muda ', 'kilojoule : 59 kj.\r\nkalori : 14 kkal.\r\nlemak : 0,17 g.\r\nprotein : 0,69 g.\r\nkarbohidrat : 2,97 g.\r\nsodium : 80 mg.\r\nkalium : 260 mg.\r\n', 'Manfaat seledri antara lain mengandung serat non larut yang baik untuk diet, kaya antioksidan yang baik untuk menjaga imunitas tubuh, mengandung vitamin A yang baik untuk kesehatan kulit dan mata, serta baik dikonsumsi untuk penderita hipertensi', 'kindom : Plantae\r\ndivisi:Magnoliophyta\r\nkelas : Magnoliopsida\r\nordo : Apiales\r\nfamili : Apiales\r\ngenus : Apium\r\nspesies : Apium graveolens L.', '', NULL, '2019-10-03 10:26:04', '2019-09-07 18:42:22', 1, 1),
('05-01-20185a4f3f8fa101c', 'buah', 'Jeruk Bali', 'Jeruk Bali (Citrus maxima)', 'Jeruk Bali adalah buah asli\r\nAsia Selatan dan Tenggara.\r\nJeruk bali merupakan buah lokal. Buah ini digolongkan sebagaibuah sejati tunggal berdaging. Kulit luar buah berwarna hijau dan daging buah berwarna merah (Kanisius, 2011). Dari empat kecamatan yang dijadikan sampel, jeruk bali ditemuakan di Kecamatan Tanggul, Ambulu dan Balung. ', 'kilojoule : 143  kj\r\nkalori : 32 kkal.\r\nlemak : 0,1 g.\r\nprotein : 0,63 g.\r\nkarbohidra : 8,08 g.\r\nkalium : 139 mg.', 'Fungsi serat pada jeruk sangat penting, antara\r\nlain membantu proses pencernaan, menurunkan\r\nkadar kolesterol dalam darah dan juga\r\nmenurunkan resiko penyakit jantung.\r\nMenghambat  terjadinya  kanker.\r\nUntuk menyembuhkan gangguan pendarahan\r\nkarena wasir, demam, mengurangi keasaman\r\ndarah, memperlancar pembentukan air seni, dan\r\nmengatur pengeluaran cairan empedu.\r\nMeningkatkan kekebalan tubuh, menurunkan\r\ntekanan darah, untuk kesehatan tulang, melawan\r\npenuaan dini, menurunkan berat badan, sampai\r\nuntuk kesehatan gigi dan mulut.', 'kindom : Plantae\r\ndivisi:Spermatophyta\r\nkelas : Dicotyledonae\r\nordo : Rutales\r\nfamili : Rutaceae\r\ngenus : Citrus\r\nspesies : Citrus maxima, Citrus sinensis', 'sub_divisi : Angiospermae\r\n', NULL, '2019-10-03 10:25:46', '2019-09-07 18:42:22', 1, 1),
('05-01-20185a4f4008b7b1a', 'sayur', 'Bunga Pepaya ', 'Bunga Pepaya (Carica papaya L.)', 'Bunga pepaya mempunyai nama ilmiah Carica papaya L. termasuk ke dalam keluarga Caricaceae. Bunga pepaya memiliki mahkota bunga berwarna kuning pucat dengan tangkai berwarna hijau muda atau duduk pada batang. Bunga jantan pada tumbuhan jantan tumbuh pada tangkai panjang. Bunga biasanya ditemukan pada daerah sekitar pucuk', 'energi 45 kkal.\r\nprotein 2,6 gr.\r\nlemak 0,3 gr.\r\nkarbohidrat 8,1 gr.\r\nkalsium 290 mg.\r\nfosfor 113 mg.\r\nzat besi 4,2 mg.\r\nvitamin a 0 iu.\r\nvitamin b1 0,01 mg.\r\nvitamin c 23,3 mg (kalie, 2008).', 'Bunga papaya mengandung energy, protein, lemak, karbohidrat, kalsium, fosfor, zat besi, vitamin A, B1 dan vitamin C. Bunga papaya yaitu untuk melancarkan system pencernaan, memperbaiki nafsu makan, menangkal radikal bebas ', 'kindom : Plantae\r\ndivisi:Spermatophyta\r\nkelas : Dicotylodenae\r\nordo : Caricales\r\nfamili : Caricaceae (Labiatae)\r\ngenus : Carica\r\nspesies : Carica papaya L.', 'sub_kindom : Tracheobionta\r\nsub_divisi : Angiospermae\r\n', NULL, '2019-10-02 14:03:43', '2019-09-07 18:42:22', 1, 1),
('05-01-20185a4f40166c339', 'buah', 'Semangka', 'Semangka merah (Citrullus lanatus)', 'Tanaman semangka berasal dari Afrika dan saat ini telah menyebar ke seluruh dunia, \r\nbaik di daerah subtropis maupun tropis.\r\nSemangka merah merupakan buah lokal. Buah ini digolongkan sebagai buah sejati tunggal berdaging. Kulit luar buah berwarna hijau dan daging buah berwarna merah (Hermanto, 2013). Dari empat kecamatan yang dijadikan sampel, buah semangka merah ditemukan di Kecamatan Tanggul, Kaliwates, Ambulu dan Balung.\r\n', 'kilojoule :  126 kj\r\nkalori : 30 kkal.\r\nlemak : 0,15 g.\r\nprotein : 0,01 g.\r\nkarbohidrat : 7,55 g.\r\nsodium : 1 mg.\r\nkalium : 112 mg.', 'Sebagai antioksidan.\r\nDapat mencegah kanker prostat pada pria.\r\nDapat menurunkan kolesterol dan menetralkan\r\ntekanan darah.\r\nbaik bagi penderita hipertensi.\r\nKandungan air dan kalium yang sangat tinggi\r\nbisa menetralisasi tekanan darah,\r\nmempergiat kerja jantung.\r\nUntuk merangsang keluarnya air seni lebih deras\r\nsehingga baik untuk penderita gangguan buang\r\nair kecil.', 'kindom : Plantae\r\ndivisi:Magnoliophyta\r\nkelas : Magnoliopsida\r\nordo : Violes\r\nfamili : Cucurbitaceae\r\ngenus : Citrullus\r\nspesies : Citrullus lanatus', '', NULL, '2019-10-03 10:22:27', '2019-09-07 18:42:22', 1, 1);
INSERT INTO `ensiklopedia_data` (`data_id`, `kategori`, `nama`, `jenis`, `deskripsi`, `kandungan`, `manfaat`, `klasifikasi`, `sub_klasifikasi`, `video`, `created_at`, `updated_at`, `is_active`, `cek`) VALUES
('05-01-20185a4f40938e2cf', 'sayur', 'Bawang Merah ', 'Bawang Merah (AlliumColocasia esculenta)', 'Asal usul Tanaman bawang merah berasal dari daerah Asia Tengah yaitu sekitar India\r\ndan Pakistan sampai negara Palestina (Sunarjono, 2016). Bawang merah merupakan salah satu tanaman yang termasuk kedalam umbian tanah, dan juga tanaman yang memiliki perakaran yang serabut di bagian pangkal umbi. Bagian atas batang sejati merupakan umbi semu, berupa umbi lapis (bulbus) yang berasal dari modifikasi pangkal daun bawang merah ', 'kilojoule : 176 kj.\r\nkalori : 42 kkal.\r\nlemak : 0,08 g.\r\nprotein : 0,92 g.\r\nkarbohidrat : 10,11 g.\r\nsodium : 3 mg.\r\nkalium : 144 mg.', 'Bawang merah berfungsi sebagai obat untuk memudahkan pencernaan, menghilangkan lendir dalam kerongkongan, serta dapat mendorong napas panjang. Selain itu, bawang merah berguna untuk tubuh karena mengandung zat gizi berupa vitamin B dan vitamin C ', 'kindom : Plantae\r\ndivisi:Spermatophyta\r\nkelas : Monocotyledonae\r\nordo : Liliales\r\nfamili : Liliaceae\r\ngenus : Allium\r\nspesies : Allium ascalonicum L.', 'sub_divisi : Angiospermae\r\n', NULL, '2019-10-03 10:27:35', '2019-09-07 18:42:22', 1, 1),
('05-01-20185a4f40a33c5cf', 'buah', 'Semangka', '2.	Semangka kuning ', 'Semangka kuning \r\nSemangka kuning merupakan buah lokal. Buah ini digolongkan sebagai buah sejati tunggal berdaging. Kulit luar buah berwarna hijau dan daging buah berwarna kuning (Hermanto, 2013). Dari empat kecamatan yang dijadikan sampel, buah semangka kuning ditemuakan di Kecamatan Tanggul, Kaliwates,  dan Ambulu. \r\n', 'kilojoule : 126  kj\r\nkalori : 30 kkal.\r\nlemak : 0,15 g.\r\nprotein : 0,01 g.\r\nkarbohidrat : 7,55 g.\r\nsodium : 1 mg.\r\nkalium : 112 mg.', 'Sebagai antioksidan.\r\nDapat mencegah kanker prostat pada pria.\r\nDapat menurunkan kolesterol dan menetralkan\r\ntekanan darah.\r\nbaik bagi penderita hipertensi.\r\nKandungan air dan kalium yang sangat tinggi\r\nbisa menetralisasi tekanan darah,\r\nmempergiat kerja jantung.\r\nUntuk merangsang keluarnya air seni lebih deras\r\nsehingga baik untuk penderita gangguan buang\r\nair kecil .', 'kindom : Plantae\r\ndivisi:Magnoliophyta\r\nkelas : Magnoliopsida\r\nordo : Violes\r\nfamili : Cucurbitaceae\r\ngenus : Citrullus\r\nspesies : Citrullus lanatus', '', NULL, '2019-10-03 10:22:58', '2019-09-07 18:42:22', 1, 1),
('05-01-20185a4f40b1b5e74', 'buah', 'Pisang ', 'Pisang ambon (Musa paradisiaca)', 'Budidaya pisang diyakini pertama kali dilakukan di dataran tinggi Papua Nugini.\r\nPisang merupakan buah lokal. Buah ini digolongkan sebagai buah sejati tunggal berdaging. Kulit luar buah berwarna kuning dan daging buah berwarna kuning (Hermanto, 2013). Dari empat kecamatan yang dijadikan sampel, pisang ambon ditemuakan di Kecamatan dan Balung.', 'kilojoule : 406  kj\r\nkalori : 97 kkal.\r\nlemak : 0,6 g.\r\nprotein : 1,3 g.\r\nkarbohidrat : 25,8 g.\r\nkalium : 370 mg.', 'Sebagai Sumber Energi.\r\nKandungan Asam Folat.\r\nMengurangi gangguan usus.\r\nMengobati gangguan liver.\r\nMenurunkan Resiko Diabetes.\r\nMenurunkan berat bada.\r\nMembantu pengobatan hipertensi.\r\nMelancarkan sistem pencernaan.\r\nMencegah serangan jantung.\r\nMeningkatkan sistem kekebalan tubuh.\r\nMeredakan rasa nyeri.\r\nMenjaga kesehatan mata.\r\nMenjaga daya ingat.\r\nMenambah mood dan menghindari stress.\r\nMasker wajah.', 'kindom : Plantae\r\ndivisi:Magnoliophyta\r\nkelas : Liliopsida\r\nordo : Zingiberales\r\nfamili : Musaceae \r\ngenus : Musa\r\nspesies : Musa sp. ', '', NULL, '2019-10-03 10:16:54', '2019-09-07 18:42:22', 1, 1),
('05-01-20185a4f4133349b9', 'buah', 'Pisang ', 'Pisang barlin  (Musa paradisiaca)', 'Budidaya pisang diyakini pertama kali dilakukan di dataran tinggi Papua Nugini.\r\nPisang barlin merupakan buah lokal. Buah ini digolongkan sebagai buah sejati tunggal berdaging. Kulit luar buah berwarna kuning dan daging buah berwarna putih (Hermanto, 2013). Dari empat kecamatan yang dijadikan sampel, pisang barlin ditemuakan di Kecamatan Balung', 'kilojoule :  439 kj\r\nkalori : 105 kkal.\r\nlemak : 0,39 g.\r\nprotein : 1,29 g.\r\nkarbohidrat : 26,95 g.\r\nsodium : 1 mg.\r\nkalium : 422 mg.', 'Sumber energi.\r\nKesehatan jantung.\r\nBaik untuk darah.\r\nSistem saraf yang sehat.\r\nKesehatan ginjal.\r\nMood booster.\r\nAnemia.\r\nBaik untuk otak.\r\nLuka lambung.\r\nMengatasi sembelit.', 'kindom : Plantae\r\ndivisi:Magnoliophyta\r\nkelas : Liliopsida\r\nordo : Zingiberales\r\nfamili : Musaceae\r\ngenus : Musa\r\nspesies : Musa sp.', '', NULL, '2019-10-03 10:17:33', '2019-09-07 18:42:22', 1, 1),
('05-01-20185a4f413dbf2ee', 'buah', 'Pepaya', 'Pepaya california (Carica papaya L.) ', 'Tanaman Pepaya yang memiliki nama latin (Carica papaya L) merupakan tanaman\r\nyang berasal dari Meksico bagian selatan dan Nikaragua.\r\nPepaya california merupakan buah lokal. Buah ini digolongkan sebagai buah sejati tunggal berdaging. Kulit luar buah berwarna hijau kekuningan dan daging buah berwarna oranye (Hermanto, 2013). Dari empat kecamatan yang dijadikan sampel, pepaya caifornia ditemuakan di Kecamatan Tanggul, Kaliwates, Ambulu, dan Balung. \r\n', 'kilojoule : 230  kj\r\nkalori : 55 kkal.\r\nlemak : 0,2 g.\r\nprotein : 0,85 g.\r\nkarbohidrat : 13,73 g.\r\nsodium : 4 mg.\r\nkalium : 360 mg.', 'Membantu menyehatkan mata.\r\nMencegah hipertensi.\r\nMenjaga kesehatan jantung.\r\nSebagai antioksidan.\r\nMenjaga kesehatan saluran cerna.\r\nMenjaga kesehatan kulit.\r\nMembantu menurunkan berat badan.\r\nMembantu mengatasi diabates.', 'kindom : Plantae\r\ndivisi:Magnoliophyta\r\nkelas : Magnoliopsida\r\nordo : Violales\r\nfamili : Caricaceae\r\ngenus : Carica\r\nspesies : Carica papaya L.', '-', NULL, '2019-10-03 10:14:33', '2019-09-07 18:42:22', 1, 1),
('05-01-20185a4f417e69e78', 'buah', 'Pepaya', 'Pepaya Thailand (Carica papaya L.)', 'Pepaya bangkok bukan hanya tanaman asli indonesia. jenis pepaya bangkok ini\r\ndidatangkan dari thailand sekitar tahun 70-an.\r\nPepaya thailand merupakan buah lokal. Buah ini digolongkan sebagai buah sejati tunggal berdaging. Kulit luar buah berwarna hijau kekuningan dan daging buah berwarna oranye (Hermanto, 2013). Dari empat kecamatan yang dijadikan sampel, pepaya thailand ditemuakan di Kecamatan Tanggul dan Kaliwates.\r\n', 'kilojoule :  230 kj\r\nkalori : 55 kkal.\r\nlemak : 0,2 g.\r\nprotein : 0,85 g.\r\nkarbohidrat : 13,73 g.\r\nsodium : 4 mg.\r\nkalium : 360 mg.', 'Membantu menyehatkan pencernaan.\r\nMencegah penyakit kanker.\r\nMeningkatkan daya tahan tubuh.\r\nMencegah osteoporosis.\r\nAnti peradangan.\r\nMenu makanan diet.\r\nAnti oksidan.\r\nMencegah sariawan.\r\nMenguatkan tulang.\r\nMenyehatkan kulit.\r\nMengatasi jerawat.\r\nMasker wajah yang alami.\r\nMencerahkan kulit.\r\nAnti penuaan dini.', 'kindom : Plantae\r\ndivisi:Magnoliophyta\r\nkelas : Magnoliopsida\r\nordo : Violales\r\nfamili : Caricaceae\r\ngenus : Carica\r\nspesies : Carica papaya L.', '-', NULL, '2019-10-03 10:13:52', '2019-09-07 18:42:22', 1, 1),
('05-01-20185a4f41880f37e', 'buah', 'Pisang ', 'Pisang kayu', 'Pisang kayu yang ditemukan dari hasil penelitian merupakan buah lokal. Buah ini digolongkan sebagai buah sejati tunggal berdaging. Kulit luar buah berwarna kuning dan daging buah berwarna kuning (Hermanto, 2013). Dari empat kecamatan yang dijadikan sampel, pisang kayu ditemuakan di Kecamatan dan Balung.', '-', '-', 'kindom : Plantae\r\ndivisi:Magnoliophyta\r\nkelas : Liliopsida\r\nordo : Zingiberales\r\nfamili : Musaceae\r\ngenus : Musa\r\nspesies : Musa sp.', '', NULL, '2019-10-03 10:19:36', '2019-09-07 18:42:22', 1, 1),
('05-01-20185a4f41cea7d0e', 'buah', 'Pisang ', 'Pisang kepok (Musa paradisiaca)', 'Asal usul pisang kepok bermula dari negara Filipina. \r\nPisang kepok merupakan buah lokal. Buah ini digolongkan sebagai buah sejati tunggal berdaging. Kulit luar buah berwarna kuning dan daging buah berwarna kuning (Hermanto, 2013). Dari empat kecamatan yang dijadikan sampel, pisang kepok ditemuakan di Kecamatan dan Balung.', 'kilojoule :  439 kj\r\nkalori : 105 kkal.\r\nlemak : 0,39 g.\r\nprotein : 1,29 g.\r\nkarbohidrat : 26,95 g.\r\nsodium : 1 mg.\r\nkalium : 422 mg.', 'Meredakan penyakit maag akut dan kronis.\r\nMengobati penyakit batuk darah dan diabetes.\r\nMenurunkan berat badan.\r\nMengatasi sembelit dan diare .', 'kindom : Plantae\r\ndivisi:Magnoliopsyta\r\nkelas : Liliopsida\r\nordo : Zingiberales\r\nfamili : Musaceae\r\ngenus : Musa\r\nspesies : Musa sp.', '', NULL, '2019-10-03 10:18:20', '2019-09-07 18:42:22', 1, 1),
('05-01-20185a4f421771a81', 'buah', 'Pisang', 'Pisang mas', 'Pisang mas merupakan buah lokal. Buah ini digolongkan sebagai buah sejati tunggal berdaging. Kulit luar buah berwarna kuning dan daging buah berwarna kuning (Hermanto, 2013). Dari empat kecamatan yang dijadikan sampel, pisang mas ditemuakan di Kecamatan dan Balung.', '-', '-', 'kindom : Plantae\r\ndivisi:Magnoliophyta\r\nkelas : Liliopsida\r\nordo : Zingiberales\r\nfamili : Musaceae\r\ngenus : Musa\r\nspesies : Musa sp.', '', NULL, '2019-10-03 10:20:06', '2019-09-07 18:42:22', 1, 1),
('05-01-20185a4f42795c901', 'buah', 'Pisang', 'Pisang raja (Musa sapientum)', 'Pisang raja berasal dari kawasan Asia Tenggara dan pulau-pulau pasifik barat.\r\nPisang raja merupakan buah lokal. Buah ini digolongkan sebagai buah sejati tunggal berdaging. Kulit luar buah berwarna kuning dan daging buah berwarna kuning (Hermanto, 2013). Dari empat kecamatan yang dijadikan sampel, pisang raja ditemuakan di Kecamatan dan Balung. ', 'kilojoule : 439  kj\r\nkalori : 105 kkl.\r\nlemak : 0,39 g.\r\nprotein : 1,29 g.\r\nkarbohidrat : 26,95 g.\r\nsodium : 1 mg.\r\nkalium : 422 mg.', 'Pisang memiliki banyak kandungan yang berguna bagi tubuh dan memiliki banyak\r\nmanfaat. Dalam buah pisang mulai dari rhizoma yang dimilikinya sampai kulit pisang dapat\r\nkita ambil manfaatnya. Daging buahya sebagai makanan, kulit pisang dapat dimanfaatkan\r\nuntuk membuat cuka pisang dengan proses fermentasi, bonggol pisang dapat dijadikan soda \r\nsebagai bahan baku sabun dan pupuk kalium. ', 'kindom : Plantae\r\ndivisi:Magnoliophyta\r\nkelas : Liliopsida\r\nordo : Zingiberales\r\nfamili : Musaceae\r\ngenus : Musa\r\nspesies : Musa sp.', '', NULL, '2019-10-03 10:20:45', '2019-09-07 18:42:22', 1, 1),
('05-01-20185a4f42e4757ef', 'buah', 'Pisang ', 'Pisang raja nangka (Musa sp L)', 'Asal tanaman pisang adalah India, jazirah Malaya,\r\ndan Filipina. \r\nPisang raja nangka merupakan buah lokal. Buah ini digolongkan sebagai buah sejati tunggal berdaging. Kulit luar buah berwarna kuning dan daging buah berwarna kuning (Hermanto, 2013). Dari empat kecamatan yang dijadikan sampel, pisang raja nangka ditemuakan di Kecamatan dan Balung.', 'kilojoule :  439 kj\r\nkalori : 105 kkal.\r\nlemak : 0,39 g.\r\nprotein : 1,29 g.\r\nkarbohidrat : 26,95 g.\r\nsodium : 1 mg.\r\nkalium : 422 mg.', 'air umbi batang pisang yang dapat digunakan sebagai obat disentri dan pendarahan\r\nusus besar dan air batang pisang yang digunakan sebagai obat sakit kencing dan penawar\r\nracun. Pisang dapat memberikan tambahan energi langsung yang cukup banyak.', 'kindom : Plantae\r\ndivisi:Magnoliophyta\r\nkelas : Liliopsida\r\nordo : Zingiberales\r\nfamili : Musaceae\r\ngenus : Musa\r\nspesies : Musa sp.', '', NULL, '2019-10-03 10:19:06', '2019-09-07 18:42:22', 1, 1),
('05-01-20185a4f432cb733c', 'buah', 'Pisang ', 'Pisang susu', 'Pisang susu merupakan buah lokal. Buah ini digolongkan sebagai buah sejati tunggal berdaging. Kulit luar buah berwarna kuning dan daging buah berwarna kuning (Hermanto, 2013). Dari empat kecamatan yang dijadikan sampel, pisang susu ditemuakan di Kecamatan dan Balung', '-', '-', 'kindom : Plantae\r\ndivisi:Magnoliophyta\r\nkelas : Liliopsida\r\nordo : Zingiberales\r\nfamili : Musaceae\r\ngenus : Musa\r\nspesies : Musa sp.', '', NULL, '2019-10-03 10:19:51', '2019-09-07 18:42:22', 1, 1),
('05-01-20185a4f433680a6c', 'buah', 'Mangga ', 'Mangga gadung (Mangifera indica) ', 'Buah mangga diperkirakan berasal dari India sekitar abad ke-4 atau ke-5 SM. Sejarah \r\nmencatat, mangga pertama kali ditemukan oleh Alexander Agung di Lembah Indus India.\r\nMangga gadung merupakan buah lokal. Buah ini digolongkan sebagaitermasuk buah sejati tunggal berdaging. Kulit luar buah berwarna hijau dan daging buah berwarna oranye (Hermanto, 2013). Dari empat kecamatan yang dijadikan sampel, mangga gadung hanya ditemuakan di Kecamatan Kaliwates. \r\n', 'kilojoule :  272 kj\r\nkalori : 65 kkal.\r\nlemak : 0,27 g.\r\nprotein : 0,51 g.\r\nkarbohidrat : 17 g.\r\nsodium : 2 mg.\r\nkalium : 156 mg.', 'Sebagai penangkal kanker.\r\nMelindungi dan menyehatkan sistem pencernaan.\r\nMenurunkan kolesterol jahat.\r\nMenurunkan berat badan.\r\nMeningkatkan sistem kekebalan tubuh.\r\nMenyehatkan mata.\r\nMengatasi anemia.\r\nMencegah penyakit jantung.', 'kindom : Plantae\r\ndivisi:Spermatophyta\r\nkelas : Magnoliopsida\r\nordo : Sapindales\r\nfamili : Anacardiaceae\r\ngenus : Mangifera \r\nspesies : Mangifera indica', '-', NULL, '2019-10-03 10:11:24', '2019-09-07 18:42:22', 1, 1),
('05-01-20185a4f438143aef', 'buah', 'Mangga', 'Mangga manalagi  (Mangifera indica) ', 'Buah mangga diperkirakan berasal dari India sekitar abad ke-4 atau ke-5 SM. Sejarah \r\nmencatat, mangga pertama kali ditemukan oleh Alexander Agung di Lembah Indus India.\r\nMangga manalagi merupakan buah lokal. Buah ini digolongkan sebagaibuah sejati tunggal berdaging. Kulit luar buah berwarna hijau dan daging buah berwarna oranye (Hermanto, 2013). Dari empat kecamatan yang dijadikan sampel, mangga manalagi ditemuakan di Kecamatan Tanggul, Kaliwates, Ambulu dan Balung. \r\n', 'kilojoule : 272  kj\r\nkalori : 65 kkal.\r\nlemak : 0,27 g.\r\nprotein : 0,51 g.\r\nkarbohidrat : 17 g.\r\nsodium : 2 mg.\r\nkalium : 150 mg.', 'Sebagai antioksidan.\r\nMembantu menurunkan kadar kolesterol.\r\nMengurangi resiko serangan stroke.', 'kindom : Plantae\r\ndivisi:Spermatophyta\r\nkelas : Magnoliopsida\r\nordo : Sapindales\r\nfamili : Anacardiaceae\r\ngenus : Mangifera\r\nspesies : Mangifera indica', '-', NULL, '2019-10-03 10:10:53', '2019-09-07 18:42:22', 1, 1),
('05-01-20185a4f43c8c3a2a', 'buah', 'Apel (Malus Sp.)', 'Apel Anna ', 'Apel Anna merupakan buah lokal. Buah ini digolongkan sebagaibuah sejati tunggal berdaging. Kulit luar buah berwarna hijau semburat merah dan daging buah berwarna putih (Yulianti, 2007). Dari empat kecamatan yang dijadikan sampel, apel anna ditemuakan di Kecamatan Kaliwates dan Balung. ', '-', '-', 'kindom : Plantae\ndivisi:Spermatophyta\nkelas : Dicotyledonae\nordo : Rosales\nfamili : Rosaceae\ngenus : Malus\nspesies : Malus sylvestris Mill', '', NULL, '2019-09-07 20:42:22', '2019-09-07 18:42:22', 1, 1),
('05-01-20185a4f4406b6d41', 'buah', 'Apel (Malus Sp.)', 'Apel Manalagi', 'Apel manalagi merupakan buah lokal. Buah ini digolongkan sebagaibuah sejati tunggal berdaging. Kulit luar buah berwarna hijau dan daging buah berwarna putih (Yulianti, 2007). Dari empat kecamatan yang dijadikan sampel, apel manalagi  ditemuakan di Kecamatan Tanggul, Kaliwates, Ambulu dan Balung.  ', '-', '-', 'kindom : Plantae\ndivisi:Spermatophyta\nkelas : Dicotyledonae\nordo : Rosales\nfamili : Rosaceae\ngenus : Malus\nspesies : Malus sylvestris Mill', '', NULL, '2019-09-07 20:42:22', '2019-09-07 18:42:22', 1, 1),
('05-01-20185a4f440841a98', 'buah', 'Salak', 'Salak Jawa (Salacca edulis) ', 'Salak jawa merupakan buah lokal. Buah ini digolongkan sebagai buah sejati tunggal berdaging. Kulit luar buah berwarna coklat tua dan daging buah putih (Hermanto, 2013). Dari empat kecamatan yang dijadikan sampel, salak jawa ditemuakan di Kecamatan Tanggul dan Ambulu. \r\n', 'kilojoule : 33  kj\r\nkalori : 8 kkal.\r\nlemak : 0,02 g.\r\nprotein : 0,01 g.\r\nkarbohidrat : 2,02 g.\r\nkalium : 11 mg.', 'Sebagai antioksidan.\r\nKandungan  flavonoid  di  dalam  ekstrak  kulit \r\nsalak  mampu  menurunkan  kadar glukosa\r\ndalam darah.\r\nKandungan zat gizi dan fitonutrien pada buah\r\nsalak berpotensi membantu program diet. ', 'kindom : Plantae\r\ndivisi:Magnoliophyta\r\nkelas : Liliopsida\r\nordo : Arecales\r\nfamili : Arecaceae\r\ngenus : Salacca\r\nspesies : Salacca zalacca', '', NULL, '2019-10-03 10:21:12', '2019-09-07 18:42:22', 1, 1),
('05-01-20185a4f4443c4605', 'buah', 'Apel (Malus Sp.)', 'Apel Rome Beauty ', 'Apel rome beauty  merupakan buah lokal. Buah ini digolongkan sebagaitermasuk buah sejati tunggal berdaging. Kulit luar buah berwarna hijau semburat merah dan daging buah berwarna putih (Yulianti, 2007). Dari empat kecamatan yang dijadikan sampel, apel rome beauty ditemuakan di Kecamatan Tanggul, Ambulu dan Balung', '-', '-', 'kindom : Plantae\ndivisi:Spermatophyta\nkelas : Dicotyledonae\nordo : Rosales\nfamili : Rosaceae\ngenus : Malus\nspesies : Malus sylvestris Mill', '', NULL, '2019-09-07 20:42:22', '2019-09-07 18:42:22', 1, 1),
('2019-10-02-5d94050d38484', 'buah', 'Jeruk Nipis', 'Jeruk Nipis (Citrus aurantifolia)', 'Jeruk nipis merupakan salah satu jenis citrus (jeruk) yang asal usulnya adalah dari\r\nIndia dan Asia Tenggara.\r\nJeruk nipis merupakan buah sejati tunggal (hesperedium). Jeruk nipis termasuk jenis tumbuhan perdu. Buahnya berbentuk bulat dengan diameter 3,5-5 cm, kulit berwarna hijau atau kekuning-kuningan, dan daging berwarna putih pucat. Tanaman jeruk nipis mempunyai akar tunggang. Buah jeruk nipis yang sudah tua rasanya asam. Hasil penelitian buah jeruk nipis yang berada di Kabupaten Jember dapat ditemukan di Kecamatan Kaliwates, Tanggul, Ambulu, dan Balung.', 'kilojoule : 71 kj\r\nkalori : 17 kkal.\r\nlemak : 0,17 g.\r\nprotein : 0,64 g.\r\nkarbohidrat : 5,41 g.\r\nsodium : 1 mg.\r\nkalium : 80 mg.', 'Membantu untuk mencegah kanker.\r\nMeningkatkan imunitas tubuh.\r\nMenurunkan kadar kolesterol.\r\nMembantu menurunkan berat badan.\r\nMembantu menjaga berat badan tetap ideal.\r\nMembantu mencerahkan wajah.\r\nMengatasi masalah jerawat.', 'Kingdom 	: Plantae (Tumbuhan).\r\nDivisi 		: Spermatophyta (Menghasilkan biji).\r\nKelas 		: Magnoliopsida (Berkeping dua/ dikotil).\r\nSub kelas 	: Rosidae.\r\nOrdo 		: Sapindales.\r\nFamili 		: Rutaceae.\r\nGenus 		: Citrus.\r\nSpesies 	: Citrus aurantifolia (Sumber: Rukmana, 2005).', '', NULL, '2019-10-03 10:07:11', '2019-10-02 02:01:49', 1, 1),
('2019-10-02-5d9408aeed117', 'buah', 'Jeruk', 'Jeruk (Citrus sp)', 'tanaman jeruk berasal dari Pegunungan Himalaya. Berkat\r\nperubahan iklim, tanaman jeruk pun menyebar ke daerah Asia dan Australia.\r\nJeruk merupakan buah sejati tunggal berdaging. Buah jeruk yang ditemukan di lapangan adalah jenis buah jeruk semboro yang dibudidayakan di Semboro.Buah jeruk memiliki kulit yang tebal kurang lebih 4 mm, berbentuk bulat, memiliki berat 350-600 gram, kulit berwarna hijau ketika muda sedangkan ketika matang berwarna hijau kekuningan, dan warna daging buah kuning pucat atau jingga. Jeruk memiliki biji yang terdapat dalam daging buah dengan bentuk seperti telur namun runcing di salah satu ujungnya, memiliki ukuran panjang 5-10 mm. Jeruk yang ditemukan dalam penelitian ini adalah jeruk semboro. Hasil penelitian buah jeruk yang berada di Kabupaten Jember dapat ditemukan di Kecamatan Kaliwates, Tanggul, Ambulu,dan Balung.', 'kilojoule : 259 kj\r\nkalori ; 62 kkal.\r\nlemak : 0,16 g.\r\nprotein : 1,23 g.\r\nkarbohidrat : 15,39 g.\r\nkalium : 237 mg.', 'Jeruk menurunkan risiko stroke.\r\nJeruk dapat menurunkan tekanan darah.\r\nJeruk dapat mencegah kanker.\r\nJeruk menjaga kesehatan jantung.\r\nJeruk mencegah kerusakan kulit.\r\nJeruk baik untuk sistem alkali tubuh\r\n(pencernaan).\r\nJeruk sumber karbohidrat.\r\nBuah jeruk membantu menjaga sistem imun.\r\nBuah jeruk meningkatkan fungsi otak.\r\nBuah jeruk sangat baik menjaga kesehatan ginjal.\r\nMengobati sariawan.\r\nMenjaga stamina.\r\nJeruk membantu pembentukan otot.\r\nJeruk melancarkan pencernaan.\r\nMembantu diet.\r\nJeruk membantu kesehatan syaraf.\r\nBuah jeruk dapat menghaluskan kulit.\r\nJeruk dapat menyejukkan kulit kepala.', 'Kingdom 	: Plantae.\r\nDivisi 		: Spermatophyta(Menghasilkan biji).\r\nKelas 		: Magnoliopsida (Berkeping dua/ dikotil).\r\nSubkelas 	: Rosidae.\r\nOrdo 		: Sapindales.\r\nFamili 		: Rutaceae.\r\nGenus 		: Citrus.\r\nSpesies 	: Citrus sp (Sumber: http//agroteknologi.web.id, 2017).', '', NULL, '2019-10-03 10:08:00', '2019-10-02 02:17:18', 1, 1),
('2019-10-02-5d940b6b00750', 'buah', 'Belimbing Wuluh', 'BELIMBING WULUH (Averrhoa bilimbi L)', 'Belimbing wuluh atau belimbing sayur diduga berasal dari kepulauan Maluku dan \r\nkini tersebar ke seluruh Indonesia dan negara-negara sekitar seperti Filipina, Myanmar, dan\r\nSrilanka.\r\nBuah belimbing wuluh merupakan buah buni, berbentuk bulat lonjong bersegi, panjang 4,0-6,5 cm, berwarna hijau kekuningan, bila masak berair, memiliki rasa yang masam. Kulit buah mengkilap dan tipis. Belimbing wuluh memiliki biji yang kecil, datar, cokelat, dan ditutupi dengan lendir. Hasil penelitian belimbing wuluh yang berada di Kabupaten Jember dapat ditemukan di Kecamatan Kaliwates, Tanggul, Ambulu, dan Balung.', 'energi : 32 kal.\r\nkarbohidrat : 7 g.\r\nprotein 0,4 g.\r\nkalsium : 10 mg.\r\nfosfor : 10 mg.\r\nzat besi : 1,0 mg.\r\nvitamin c : 25 mg.\r\nserat : 33 g.\r\nkadar air : 93 g.', 'Menyehatkan pencernaan.\r\nPencegahan kanker.\r\nKaya antioksidan.\r\nMeningkatkan kerja enzim.\r\nMengatasi  tekanan darah tinggi.\r\nMengatasi gangguan ginjal.\r\nMengurangi kadar kolesterol jahat.\r\nBelimbing memberikan nutrisi lain yang baik\r\nuntuk rambut.\r\nMakan buah belimbing atau menggunakan\r\nbelimbing langsung pada kulit berjerawat.', 'Kingdom 	: Plantae (Tumbuhan).\r\nSubkingdom 	: Tracheobionta (Tumbuhan ber pembuluh).\r\nSuper Divisi 	: Spermatophyta (Menghasilkan biji).\r\nDivisi 		: Magnoliophyta (Tumbuhan berbunga).\r\nKelas 		: Magnoliopsida (Berkeping dua/ dikotil).\r\nSub Kelas 	: Rosidae.\r\nOrdo 		: Geraniales.\r\nFamili 		: Oxalidaceae (Suku belimbing-belimbingan).\r\nGenus 		: Averrhoa.\r\nSpesies 	: Averrhoa bilimbi L. (Sumber: http//agroteknologi.web.id, 2017).\r\n', '', NULL, '2019-10-02 14:14:04', '2019-10-02 02:28:59', 1, 1),
('2019-10-02-5d940cae824df', 'buah', 'Durian', 'Durian (Durio zibethinus)', 'Buah durian merupakan buah yang termasuk dalam gologan buah sejati tunggal berdaging. Setiap buah biasanya memiliki lima ruang dan panjang buahnya dapat mencapai hingga 25 cm dengan diameter 20 cm. Warna kulit buah hijau kuning hingga kecokelatan yang tertutup dengan duri tajam berbentuk kerucut. Daging buah berwarna putih atau putih kekuningan tergantung pada jenisnya dan memiliki biji yang terbungkus oleh daging buah. Berat buah durian pada umumnya dapat mencapai 1,5-5 kg. Hasil penelitian buah duarian yang berada di Kabupaten Jember dapat ditemukan di Kecamatan Kaliwates.', 'kilojoule : 3703 kj\r\nkalori : 885 kkal.\r\nlemak : 32,09 g.\r\nprotein : 8,85 g.\r\nkarbohidrat : 163,08 g.\r\nsodium : 12 mg.\r\nkalium : 2625 mg.', 'Mencegah dan mengobati sembelit.\r\nMembantu mencegah anemia.\r\nPerbaiki kesehatan kulit.\r\nMembantu menjaga kesehatan tulang.\r\nMengatur kadar gula darah.\r\nMembantu menjaga fungsi tiroid.\r\nManfaat buah durian mendorong nafsu makan.\r\nMembantu meredakan migrain.\r\nMembantu mencegah depresi.\r\nInstrumental dalam pembentukan tulang dan gigi.', 'Kingdom	: Plantae .\r\nSubkingdom	: Tracheobionta (Tumbuhan berpembuluh).\r\nSuper Divisi	: Spermatophyta (Menghasilkan biji).\r\nDivisi		: Magnoliophyta (Tumbuhan berbunga).\r\nKelas		: Magnoliopsida (Berkeping dua/ dikotil).\r\nSub Kelas	: Dilleniidae.\r\nOrdo		: Malvales.\r\nFamili		: Bombaceae.\r\nGenus		: Durio.\r\nSpesies	: Durio zibethinus (Sumber: Sobir, 2010).\r\n', '', NULL, '2019-10-03 10:05:08', '2019-10-02 02:34:22', 1, 1),
('2019-10-02-5d940dbea5d53', 'buah', 'Jambu Kristal', 'Jambu Kristal (Psidium guajava L.)', 'Buah kristal merupakan buah sejati tunggal berdaging bertipe buah buni dan berbentuk bulat. Buah berdompolan dan berwarna hijau sampai hijau kekuningan. Kulit jambu kristal ketika matang hijau keputihan-putihan dan warna daging buah putih dengan tekstur matang. Buah ini memiliki biji yang sedikit bahkan ada pula yang tidak memiliki biji. Berat yang dimiliki oleh jambu kristal antara 500-900 gram per buah dengan panjang buah 4-8 cm.', 'kilojoule : 285 kj\r\nkalori : 68 kkal.\r\nlemak : 0,95 g.\r\nprotein : 2,55 g.\r\nkarbohidrat : 14,32 g.\r\nsodium : 2 mg.\r\nkalium : 417 mg.', 'Baik untuk penderita diare.\r\nMencegah sulit buang air besar atau sembelit.\r\nMengobati batuk dan flu.\r\nMenjaga kesehatan kulit.\r\nMencegah kulit kering dan bersisik.\r\nMengangkat sel kulit mati.\r\nMencerahkan wajah.\r\nMenutrisi kulit dari dalam.\r\nMenjaga kelembaban kulit.\r\nMenjaga rasa kenyang.\r\nBaik untuk kesehatan pencernaan.\r\nMenjaga dan meningkatkan daya tahan tubuh.\r\nSebagai zat anti oksidan.\r\nBaik untuk kesehatan mata.\r\nMemberikan energi bagi tubuh.\r\nBaik untuk kesehatan tulang.\r\nMengobati sariawan.\r\nMencegah anemia.\r\nMencegah infeksi dan juga virus.', 'Kingdom 	: Plantae .\r\nSub kingdom 	: Tracheobionta (Tumbuhan berpembuluh).\r\nSuper divisi 	: Spermatophyta (Menghasilkan biji).\r\nDivisi 		: Magnoliophyta (Tumbuhan berbunga).\r\nKelas 		: Magnoliopsida (Berkeping dua/ dikotil).\r\nSub kelas	: Rosidae.\r\nOrdo 		: Myrtales.\r\nFamili 		: Myrtaceae .\r\nGenus 		: Psidium.\r\nSpesies 	: Psidium guajava L. (Sumber: Parimin, 2005).\r\n', '', NULL, '2019-10-03 10:06:38', '2019-10-02 02:38:54', 1, 1),
('2019-10-02-5d940eed56c50', 'buah', 'Kelengkeng ', 'Kelengkeng (Dimocarpus longan)', 'Tanaman ini diduga berasal dari Myanmar, kemudian menyebar ke Cina Selatan, \r\nTaiwan, dan Thailand Utara.\r\nKelengkeng merupakan buah sejati tunggal berdaging. Buah lengkeng berbentuk bulat dengan kulit buah tipis. Warna buah ini yaitu hijau ketika masih muda dan cokelat ketika sudah matang. Permukaan luar buah kasar, daging buah bening transparan, dan rasanya manis. Biji lengkeng berbentuk bulat mengkilap dan warnanya hitam terbungkus oleh daging buah. Ketebalan daging buah 6-7 mm, berat buah 15-21 gram, dan diameter buah 1,2-3 cm. Hasil penelitian buah lengkeng yang berada di Kabupaten Jember dapat ditemukan di Kecamatan Kaliwates, Tanggul, Ambulu, dan Balung.', 'kilojoule : 8 kj\r\nkalori : 2 kkal.\r\nprotein : 0,04 g.\r\nkarbohidrat : 0,48 g.\r\nkalium : 9 mg.', 'Anti-depresan.\r\nMembantu kerja jantung dan limpa.\r\nMempercepat penyembuhan dan\r\nmemperpanjang harapan hidup.\r\nMelancarkan sirkulasi darah.\r\nMembantu program diet.\r\nSumber energi.\r\nMencegah demam dan flu.\r\nKesehatan kulit.\r\nMengatasi nafsu makan hilang, limpah lemah\r\ndan diare\r\nMengurangi Amnesia, penurunan mental,\r\nkecemasan (anxiety).\r\nLemah dan kurang tenaga saat hamil.\r\nMenyehatkan usus.', 'Kingdom	: Plantae .\r\nSub kingdom	: Tracheobionta (Tumbuhan berpembuluh).\r\nSuper divisi 	: Spermatophyta (Menghasilkan biji).\r\nDivisi		: Magnoliophyta (Tumbuhan berbunga).\r\nKelas		: Magnoliopsida (Berkeping dua/ dikotil).\r\nSub Kelas	: Rosidae .\r\nOrdo		: Sapindales .\r\nFamilia	: Sapindaceae .\r\nGenus		: Dimocarpus .\r\nSpecies	: Dimocarpus longan (Sumber: Rukmana, 2005).\r\n', '', NULL, '2019-10-03 10:10:04', '2019-10-02 02:43:57', 1, 1),
('2019-10-02-5d941171dd209', 'buah', 'Melinjo ', 'Melinjo (Gnetum gnemon)', 'Berdasarkan sejarahnya, melinjo berasal dari Semenanjung Malaysia.\r\nTanaman melinjo adalah tanaman berbiji terbuka atau Gymnospermae. Biji melinjo diselimuti oleh selaput luar yang keras, selaput dalam, dan diselubungi juga oleh tenda bunga yang berdaging. Biji melinjo adalah tanaman tahunan berbiji terbuka, biji tidak terbungkus oleh daging, melainkan diselimuti oleh kulit luar. Biji melinjo memiliki ukuran 1,3-5 cm, berwarna hijau muda ketika belum matang, dan berwarna merah ketika sudah matang. Hasil penelitian melinjo yang berada di Kabupaten Jember dapat ditemukan di Kecamatan Kaliwates.', 'kilojoule : 1464  kj\r\nkalori : 350 kkal.\r\nlemak : 1,49 g.\r\nprotein : 12,11 g.\r\nkarbohidrat : 69,79 g.\r\nsodium : 310 mg.\r\nkalium : 83 mg.', 'Meningkatkan kekebalan tubuh.\r\nMencegah penuaan dini.\r\nBahan alami untuk hipertensi.\r\nMemperkuat daya ingat.\r\nMenjadi bahan pengawet alami.\r\nMeningkatkan stamina.\r\nMelancarkan urin.\r\nMencegah anemia.\r\nMengobati luka.\r\nMencegah penyakit jantung.', 'Kingdom 	: Plantae .\r\nDivisi 		: Spermatophyta.\r\nSub divisi 	: Gymnospermae.\r\nKelas 		: Gnetinae.\r\nSub kelas 	: Gnetidae.\r\nOrdo 		: Gnetales.\r\nFamili 		: Gnetaceae.\r\nGenus 		: Gnetum.\r\nSpesies 	: Gnetum gnemon (Sumber: http//agroteknologi.web.id, 2017).\r\n', '-', NULL, '2019-10-03 10:12:08', '2019-10-02 02:54:41', 1, 1),
('2019-10-02-5d9412c389e2e', 'buah', 'Buah Srikaya', 'Buah Srikaya (Annona aquamosa L)', '	Buah srikaya merupakan buah semu dan berbentuk bola atau kerucut. Permukaan buahnya berbenjol, besisik berwarna hijau, dan berbintik putih. Panjang buah 5-10 cm. Daging buah berwarna putih kekuningan dan memiliki rasa yang manis. Buah srikaya memiliki biji  berwarna cokelat tua hingga hitam dengan panjang 1,2-1,6 cm yang terdapat di dalam daging buah dan jumlah biji  antara 20-38 biji per buah. Hasil penelitian buah srikayayang berada di Kabupaten Jember dapat ditemukan di Kecamatan Tanggul.', 'kilojoule : 393  kj\r\nkalori : 94 kkal.\r\nlemak : 0,29 g.\r\nprotein : 2,06 g.\r\nkarbohidrat : 23,64 g.\r\nsodium : 9 mg.\r\nkalium : 247 mg.', 'Sebagai antioksidan.\r\nMelindungi tubuh dari    penyakit jantung.\r\nMenyeimbangkan air dalam tubuh.\r\nMengurangi gejala rematik dan radang sendi,\r\nserta membantu menghilangkan asam dari sendi.\r\nMembantu melawan kelemahan otot.\r\nMenjaga  kulit,  kesehatan  rambut,  dan \r\nmeningkatkan  fungsi  mata.\r\nDapat mengontrol tekanan darah, membantu\r\nmenormalkan fungsi pencernaan,\r\nmenyembuhkansembelit, diare, dan disentri .', 'Kingdom 	: Plantae (Tumbuhan).\r\nSub Kingdom 	: Tracheobionta (Tumbuhan berpembulu).\r\nSuper Divisi 	: Spermatophyta (Menghasilkan biji).\r\nDivisi 		: Magnoliopsida (Tumbuhan berbunga).\r\nKelas 		: Magnoliopsida (Berkeping dua/ dikotil).\r\nSub Kelas 	: Magnoliidae.\r\nOrdo 		: Magnoliales.\r\nFamili		: Annonaceae.\r\nGenus 		: Annona.\r\nSpesies 	: Annona squamosa L. (Sumber: Sunarjono, 2008).\r\n', '', NULL, '2019-10-03 10:24:32', '2019-10-02 03:00:19', 1, 1),
('2019-10-02-5d9413a0f11d6', 'buah', 'Buah Sukun', 'Buah Sukun (Artocarpus communis)', 'Tanaman sukun merupakan tanaman asli kawasan Oceania, sebuah daerah yang\r\nmembentang mulai dari bagian timur Indonesia hingga ke bagian barat Amerika.\r\nSukun termasuk dalam golongan buah majemuk berbentuk bulat lonjong dengan diameter 10-30 cm. Kulit buah berwarna hijau kekuningan hingga cokelat dengan duri-duri kasar yang tereduksi menjadi pola metaphase segi empat atau segi enam dikulitnya. Daging buah sukun berwarna keputihan atau kuning pucat. Berat buah sukun kisaran 1-5 kg per buah. Hasil penelitian buah sukun yang berada di Kabupaten Jember dapat ditemukan di Kecamatan Kaliwates, Tanggul, Ambulu, dan Balung.', 'kilojoule :  431 kj\r\nkalori : 103 kkal.\r\nlemak : 0,23 g.\r\nprotein : 1,07 g.\r\nkarbohidrat : 27,12 g.\r\nsodium : 2 mg.\r\nkalium : 490 mg.', 'Buah sukun mengandungkarbohidarat, niasin,\r\nvitamin C, riboflavin, kalium, tiamin, kalsium,\r\nnatrium, dan besi.\r\nAsam aminoesensial yang terkandung pada buah\r\nbermanfaat untuk pencernaan, memperkuat gigi,\r\ntulang,mengobati penyakit ginjal, liver, dan\r\ndiabetes.', 'Kingdom 	: Plantae (Tumbuhan).\r\nSub Kingdom 	: Trachebionta (Tumbuhan berpembuluh).\r\nSuper Divisi 	: Spermatophyta (Menghasilkan biji).\r\nDivisi 		: Magnoliophyta (Tumbuhan berbunga).\r\nKelas 		: Liliopsida (Berkeping satu/ monokotil).\r\nSub Kelas 	: Commelinidae.\r\nOrdo 		: Zingiberales.\r\nFamili 		: Musaceae (suku pisang–pisangan).\r\nGenus 		: Musa.\r\nSpesies	: Artocarpus communis (Sumber: Sunarjono, 2006).', '', NULL, '2019-10-03 10:25:09', '2019-10-02 03:04:00', 1, 1),
('2019-10-02-5d94143e72584', 'buah', 'Buah Mentega', 'Buah Mentega (Nerium oleander L)', 'Buah mentega (Diospyros blancoi) adalah salah tumbuhan tropis yang banyak tumbuh\r\ndi Asia.\r\nBuah mentega tergolong tumbuhan perenial, berupa pohon, tinggi 7 – 15 m, berumah dua, tajuk dan kanopi rimbun. Buah yang dihasilkan berwarna merah kecokelatan saat sudah masak, mengeluarkan aroma yang kuat, dan kulit buahnya dipenuhi dengan rambut-rambut halus. Daging buah berwarna kuning, tektur kering, berasa manis kadang sepat, dan memiliki biji berwarna cokelat. Ada dua jenis buah mentega yakni mentega kuning dan merah (Puspita, 2017).', 'Air : 83-84,3 g. \r\nProtein : 2,8 g. \r\nKarbohidrat : 11,8 g. \r\nSerat : 1,8 g. \r\nKalsium : 46 mg. \r\nFosfor : 1,8 mg. \r\nBesi : 0,6 mg. \r\nVitamin A : 35 IU. \r\nThiamin : 0,02 mg. \r\nRiboflavin : 0,03 mg. \r\nVitamin C : 18 mg. ', 'Sebagai obat diare, desentri, antibiotik,\r\nantiperadangan, antijamur, antiprotozoa dan\r\npembasmi moluska, batuk dan demam.', 'Kingdom	: Plantae (Tumbuhan).\r\nSubkingdom	: Tracheobionta (Tumbuhan berpembuluh).\r\nSuper Divisi	: Spermatophyta (Menghasilkan biji).\r\nDivisi		: Magnoliophyta (Tumbuhan berbunga).\r\nKelas		: Magnoliopsida (berkeping dua / dikotil).\r\nSub Kelas	: Dilleniidae.\r\nOrdo		: Ebenales.\r\nFamili		: Ebenaceae .\r\nGenus		: Diospyros.\r\nSpesies	: Diospyros blancoi .\r\n', '', NULL, '2019-10-02 21:16:26', '2019-10-02 03:06:38', 1, 1),
('2019-10-02-5d9414bae9a23', 'buah', 'Buah Ciplukan ', 'Buah Ciplukan (Physalis angulata L)', 'Ciplukan adalah umbuhan asli Amerika yang kini telah tersebar secara luas di daerah \r\ntropis di dunia.\r\nBuah tumbuhan ini cukup unik, buah cecenet diselubungi seperti kubah sehingga menutupi buah dati tumbuhan tersebut, buah cecenet berbentuk bulat dengan berwarna hijau benih ketika masih mentah dan berwarna kuning saat buah sudah matang.', 'Air : 83-84,3 g. \r\nProtein : 2,8 g. \r\nKarbohidrat : 11,8 g. \r\nSerat : 1,8 g. \r\nKalsium : 46 mg. \r\nFosfor : 1,8 mg. \r\nBesi : 0,6 mg. \r\nVitamin A : 35 IU.\r\nThiamin : 0,02 mg. \r\nRiboflavin : 0,03 mg. \r\nVitamin C : 18 mg. ', 'Untuk mengobati epilepsi, tidak dapat kencing,\r\ndan penyakit kuning', 'Divisio		 : Spermatophyta.\r\nSub divisio	 : Angiospermae.\r\nClassis		 : Dicotyledoneae.\r\nSub classis 	 : Sympetalae.\r\nFamilia	 : Tubiflorae (Solanales, Personatae).\r\nOrdo		 : Solanaceae.\r\nGenus 		 : Physalis.\r\nSpecies 	 : Physalis angulata L (Van Steenis, 1997).\r\n', '', NULL, '2019-10-02 21:18:38', '2019-10-02 03:08:42', 1, 1),
('2019-10-02-5d94156258d61', 'buah', 'Buah Markisa', 'Buah Markisa (Passiflora edulis)', 'Tanaman markisa berasal dari Amerika Latin, terutama Brasil, kemudian menyebar ke\r\ndaerah-daerah tropis di dunia termasuk Indonesia.\r\nSemua jenis markisa (Passiflora) termasuk penyerbuk silang dengan bantuan lebah madu, penyerbukan sendiri masih dapat berlangsung baik untuk mendapatkan hasil panen yang optimal, biasanya penyerbukan di lakukan oleh manusia. Buah Markisa berbentuk lonjong dengan panjang ± 20 cm, diameter ± 15 cm berat 3-5 kg warna buah hijau ke putih-putihan.Buah yang sudah masak/ranum berwarna kekuningan dan beraroma khas harum buah markisa. Bentuk biji bulat pipih panjang ± 0,3 cm dan berwarna putih.', 'kilojoule :  71 kj\r\nkalori : 17 kkal.\r\nlemak : 0,13 g.\r\nprotein : 0,4 g.\r\nkarbohidrat : 4,21 g.\r\nsodium : 5 mg.\r\nkalium : 63 mg.', 'Untuk obat penenang juga berkhasiat\r\nmenghilangkan rasa nyeri (analgesik) dan\r\nmemperkuat   paru.\r\nSebagai anti radang, penenang (sedatif), peluruh\r\nkencing (diuretik), serta bersifat membersihkan\r\npanas dan racun.', 'Kingdom	 : Plantae .\r\nDivisi		 : Spermatophyta .\r\nSub divisi	 : Angiospermae .\r\nKelas		 : Dicotyledoneae .\r\nBangsa 	 : Parietales .\r\nSuku		 : Passifloraceae .\r\nMarga		 : Passitlora .\r\nJenis/ Spesies	 : Passiflora edulis (Sumber: www.petanihebat.com,2018).\r\n\r\n', '', NULL, '2019-10-03 10:28:22', '2019-10-02 03:11:30', 1, 1),
('2019-10-02-5d94163dbc956', 'buah', 'Buah Delima', 'Buah Delima (Punica granatum L)', 'Tanaman buah ini berasal dari daerah Himalaya lalu menyebar ke Afrika, Asia, Eropa dan\r\nAmerika.\r\nBuah tanaman ini berbentuk buah bulat atau buni, dengan diameter mencapai 5-12 cm yang berwarna sangat beragam dan bervariasi mulai dari merah, keungguan, cokelat, putih, maupun kehitaman. Selain itu, buah ini juga banyak ditemukan bercak – bercak yang agak menonjol pada buah yang berwarna kehitaman atau kecoklatan tua.', 'Air : 78 g .\r\nProtein : 1,6 g. \r\nLemak : 0,1 g.\r\nKarbohidrat : 14,5 g. \r\nMineral : 0,7 g. \r\nGula inversi : 20%. \r\nGlukosa : 5-10%. \r\nAsam nitrat : 0,5-3,5%. \r\nVitamin C : 14mg/100 g. ', 'Membantu wanita dalam melawan kanker\r\npayudara.\r\nDapat mencegah kerusakan otak neonatus.\r\nMencegah pembentukan bekuan darah di arteri\r\ndan membantu melarutkannya.\r\nMenurunkan LDL (kolesterol jahat) dan\r\nmeningkatkan HDL (kolesterol baik).\r\nMembantu menurunkan tekanan darah sistolik\r\nhingga hampir 5%.\r\nMengurangi  risiko stroke jantung.\r\nMenyembuhkan penyakit Alzheimer, sakit perut,\r\nradang kulit, bersin, batuk, tumpukan, cacingan,\r\nhyperacidity dan kehilangan ingatan.', 'Kingdom 	: Plantae ( Tumbuhan ).\r\nSubkingdom	: Tracheobionta ( Tumbuhan berpembuluh ).\r\nSuper divisi	: Spermatophyta ( Menghasilkan biji ).\r\nDivisi		: Magnoliophyta ( Tumbuhan berbunga ).\r\nKelas		: Magnoliopsida ( berkeping dua / dikotil ).\r\nSub kelas 	: Rosidae.\r\nOrdo		: Myrtales.\r\nFamili		: Punicaceae.\r\nGenus		: Punica.\r\nSpesies	: Punica granatum L. (Sumber: www.petanihebat.com,2018).\r\n', '', NULL, '2019-10-02 21:35:36', '2019-10-02 03:15:09', 1, 1),
('2019-10-02-5d9416c8dec33', 'buah', 'Buah Manggis', 'Buah Manggis (Garcinia mangostana L)', 'Manggis merupkan tumbuhan yang bersal dari daerah Asia Tenggara meliputi \r\nIndonesia, Malaysia, Thailand dan Myanmar.\r\nBuah tanaman manggis berbentuk bulat, terdapat tangkai dan kulit tebal berwarna hijau jika masih mudah dan matang berwarna keungguan hingga kecoklatan. Buah manggis terdapat daging tebal berwarna putih dan terdapat biji berwarna putih kecoklatan. Buah berbentuk bola tertekan dengan garis tengah 3,5-7 cm dan berwarna ungu tua serta dinding buah manggis tebal berdaging dan memiliki getah warna kuning.', 'kilojoule :  305 kj\r\nkalori : 73 kkal.\r\nlemak : 0,58 g.\r\nprotein : 0,41 g.\r\nkarbohidrat : 17,91 g.\r\nsodium : 7 mg.\r\nkalium : 48 mg.', 'Memperbaiki sel-sel yang rusak karena terpapar\r\nradikal bebas, memperlambat penuaan,\r\nmencegah penyakit degeneratif.\r\nMemiliki kandungan antibakteri dan antijamur\r\nyang memperkuat daya tahan tubuh', 'Kingdom	: plantae.\r\nDivisi		: spermatophyta.\r\nSub divisi 	: angiospermae.\r\nKelas		: guttiferae.\r\nGenus		: garcinia.\r\nSpesies	: garcinia mangostana L (Sumber: www.ristek.go.id,2018).\r\n\r\n', '', NULL, '2019-10-03 10:31:10', '2019-10-02 03:17:28', 1, 1),
('2019-10-02-5d941788cce13', 'buah', 'Buah Kersen', 'Buah Kersen (Muntingia calabura L)', 'kersen atau pohon seri ini tumbuh subur di negara-negara \r\nkawasan Asean seperti di Malaysia, Vietnam, Filipina, Thailand, Laos dan Kamboja.\r\nManggis merupkan tumbuhan yang bersal dari daerah Asia Tenggara meliputi \r\nIndonesia, Malaysia, Thailand dan Myanmar.\r\nBuah kersen termasuk buah buni bertangkai, bentuk bulat, warna buah masak merah, diameter 1-1,5 cm. Biji terdapat di dalam daging seperti pasir, dalam buah terdapat beberapa ribu biji yang kecil. Jumlah buah masak terdapat 624-630 butir/kg.', 'Air : 77800 mg. \r\nProtein : 384 mg. \r\nLemak : 1560 mg. \r\nKarbohidrat : 17900 mg. \r\nSerat : 4600 mg .\r\nAbu : 1140 mg .\r\nKalsium : 124,6 mg .\r\nFosfor : 84 mg .\r\nBesi : 1,11 mg .\r\nKaroten : 0,019 mg. \r\nRibofalin : 0,29 mg .\r\nNiacin : 0,554 mg .\r\nVitamin C : 80,5 mg .\r\nNilai energi : 380000 J/100000 mg.', 'Dapat meningkatkan daya tahan tubuh dan dapat\r\nmeningkatkan metabolisme dalam tubuh.\r\nUntuk meningkatkan daya tahan tubuh dan\r\nberguna untuk kesehatan mata dan kulit tubuh.\r\nDapat mencegah asam urat serta dapat\r\nmengurangi rasa nyeri akibat asam urat.\r\nUntuk mengobati radang dan sakit kepala.\r\n', 'Kingdom	: Plantae (Tumbuhan).\r\nSubkingdom	: Tracheobionta (Tumbuhan berpembuluh).\r\nSuper Divisi	: Spermatophyta (Menghasilkan biji).\r\nDivisi		: Magnoliophyta (Tumbuhan berbunga).\r\nKelas		: Magnoliopsida (berkeping dua/dikotil).\r\nSub Kelas	: Dilleniidae.\r\nOrdo		: Malvales.\r\nFamili		: Elaeocarpaceae.\r\nSpesies	: Muntingia calabura L. (Sumber: www.ristek.go.id,2018).\r\n', '', NULL, '2019-10-02 21:49:35', '2019-10-02 03:20:40', 1, 1),
('2019-10-02-5d9418247f6a3', 'buah', 'Buah Kenitu', 'Buah Kenitu (Chrysophyllum cainito)', 'Buah kenitu asal mula terdapat di daerah Jember sebagai buah\r\nasli daerah tersebut dan sekarang menjadi buah langka di Indonesia.\r\nBuah kenitu berbentuk seperti bola tenis namun dengan ukuran lebih kecil. Warna buah ini hijau dengan kulit licin dan halus. Daging buah berwarna putih seperti susu dengan beberapa biji berwarna hitam dan rasa cukup manis dan segar dengan tekstur daging buah yang lembut dan agak kenyal.', 'Lucumin : 1,2 %.\r\nPouterin : 0,0037%. \r\nMinyak lemak : 6,6 %. \r\nSaponin : 0,19 %. \r\nDekstrosa : 2,4 %. \r\nAbu : 3,75 %.', 'Sebagai pengobatan berbagai penyakit yang\r\nterkait langsung maupun tidak langsung dengan\r\nradikal bebas.\r\nMengurangi resiko penyakit degeneratif dan\r\npenyakit kronis seperti kanker dan penyakit\r\njantung koroner.\r\nSebagai anti inflamasi pada keadaan laringitis\r\ndan pneumonia serta pengobatan diabetes ', 'Divisi		 : Spermatophyta.\r\nSub divisi	 : Angiospermae.\r\nKelas		 : Dicotyledoneae.\r\nSuku 		 : Sapotaceae.\r\nMarga		 : Chrysophyllum.\r\nJenis		 : Chrysophyllum cainito L(Sumber: www.ristek.go.id,2018).\r\n', '', NULL, '2019-10-02 21:52:24', '2019-10-02 03:23:16', 1, 1),
('2019-10-02-5d94193012dbc', 'buah', 'Buah Melon', 'Buah Melon (Cucumis melo)', 'Melon merupakan tanaman buah semusim yang berasal dari \r\nlembah persia, Mediternia.\r\nTanaman ini memiliki buah yang terdiri dari kulit buah, daging buah, dan biji. Kulit buah tidak terlalu tebal 1-2 mm, tetapi keras dan kuat. Kulit ini memiliki lapisan yang tersusun epidermis, mesodermis dan endodermis. Bentuk buah melon ini bulat, lonjong dan lainnya dengan memiliki warna hijau, kuning dan juga ada kehijaua tua. Sedangkan daging buah berwarna hijau, kuning keputihan dan juga jingga.', 'kilojoule :  142 kj\r\nkalori : 34 kkal.\r\nlemak : 0,19 g.\r\nprotein : 0,84 g.\r\nkarbohidrat : 8,16 g.\r\nsodium : 16 mg.\r\nkalium : 267 mg.', 'Baik bagi pertumbuhan gigi, tulang dan mata\r\nMampu menurunkan resiko penyakit jantung,\r\npencegah penyakit gula darah kandungan air dan\r\ngula alami pada buah melon mampu mencegah\r\npenyakit diabetes.\r\nMembantu pencegah kanker dan dapat membuat\r\nmata sehat serta melancarkan proses pencernaan.', 'Kingdom 	: Plantae.\r\nDivisi		: Spermatophyta.\r\nSubdivisi 	: Angiospermae.\r\nKelas 		: Dicotyledonae.\r\nOrdo 		: Cucurbitales.\r\nFamily 	: Cucurbitaceae.\r\nGenus 		: Cucumis.\r\nSpesies 	: Cucumis melo L. (Sumber: www.ristek.go.id,2018).\r\n', '', NULL, '2019-10-04 01:13:29', '2019-10-02 03:27:44', 1, 1),
('2019-10-02-5d9419cd8c446', 'buah', 'Buah Rambutan ', 'Buah Rambutan (Nephelium lappaceum L)', 'Tanaman buah tropis ini dalam bahasa Inggrisnya disebut Hairy\r\nFruit berasal dari Indonesia. \r\nBentuk buah rambutan bulat hingga sedikit lonjong. Kulit buahnya tebal dan ditumbuhi duri halus yang lebih mirip bulu. Duri rambutan ada yang lebat ada yang jarang, ada yang panjang dan ada yang pendek tergantung pada varietasnya. Warna kulit buah mulai dari hijau, kuning, hingga merah. Daging buah rambutan berwarna putih cenderung bening membungkus biji yang berbentuk lonjong.', 'kilojoule :  29 kj\r\nkalori : 7 kkal.\r\nlemak : 0,02 g.\r\nprotein : 0,06 g.\r\nkarbohidrat : 1,79 g.\r\nsodium : 1 mg.\r\nkalium : 4 mg.', 'Meningkatkan kualitas sperma.\r\nMencegah penyakit jantung.\r\nMenjaga fungsi ginjal.\r\nMembentuk dan menguatkan tulang.\r\nMengatasi hipertensi.\r\nMencegah kanker.', 'Kingdom	: Plantae (Tumbuhan).\r\nSubkingdom	: Tracheobionta (Tumbuhan berpembuluh).\r\nSuper Divisi	: Spermatophyta (Menghasilkan biji).\r\nDivisi		: Magnoliophyta (Tumbuhan berbunga).\r\nKelas		: Magnoliopsida (berkeping dua/dikotil).\r\nSub Kelas	: Rosidae.\r\nOrdo		: Sapindales.\r\nFamili		: Sapindaceae.\r\nGenus		: Nephelium.\r\nSpesies	: Nephelium lappaceum L (Sumber, www.petanihebat.com, 2018).\r\n', '', NULL, '2019-10-03 10:27:34', '2019-10-02 03:30:21', 1, 1),
('2019-10-02-5d941a68f256d', 'buah', 'Buah Duku', 'Buah Duku (Lansium domesticum)', 'Lansium merupakan salah satu tanaman dari Famili Meliaceae dan merupakan tanaman bergetah dengan sosoktanaman berupa pohon tinggi yang tegak dan menahun. Lansium domesticum Corr merupakan pohon buah dengan tinggi 15 hingga 20 m dan diameter batangnya 35-40 cm. Pada batangnya beralur-alur dalam dan menjulur tinggi. Kulit batang duku berwarna cokelat kehijau-hijauan. Buahnya berbentuk bulat atau oval dengan diameter berkisar antara 2-4 cm. Kebanyakan buahnya beruang 5. Kulit buah duku muda berwarna hijau dan berubah menjadi kuning setelah buah masak. Daging buahnya tebal, berwarna putih jernih dan agak transparan, agak kenyal dan rasanya manis atau manis keasaman. Buahnya paling enak dan kulit buah duku bila buahnya masak tidak mengeluarkan getah bila dibuka, bijinya sedikit, kecil dan daging buahnya tebal, banyak dan manis. Duku tumbuh liar dan biasanya dibudidayakan di Jawa pada ketinggian kurang dari 1200m (Widyastuti, 2000, dalam mayanti, 2009).', 'kilojoule : 285  kj\r\nkalori : 68 kkal.\r\nlemak : 0,43 g.\r\nprotein : 0,85 g.\r\nkarbohidrat : 17,06 g.\r\nsodium : 1 mg.\r\nkalium : 196 mg.', 'Menjaga sistem pencernaan.\r\nMenjaga tulang.\r\nMengobati sakit perut.\r\nMenjaga kesehatan gusi dan mulut.', 'Kerajaan	: Plantae.\r\nDivisi		: Magnoliophyta.\r\nKelas		: Magnoliopsida.\r\nBangsa		: Sapindales .\r\nSuku		: Meliaceae.\r\nMarga		: Lansium.\r\nJenis		: Lansium domesticum Corr var duku Hasskl (Sunarti, 1987).\r\n', '', NULL, '2019-10-03 10:26:42', '2019-10-02 03:32:56', 1, 1),
('2019-10-02-5d941ae68e055', 'buah', 'Buah Buni ', 'Buah Buni (Antidesma bunius)', 'Buni merupakan tumbuhan asli Asia Tenggara dan Australia Utara, anggota famili\r\nPhyllanthaceae.\r\nBuah tersusun dalam tandan, berbentuk bulat atau bulat telur, bergaris tengah sekitar 3 cm, berwarna hijau pada saat masih muda dan menjadi merah tua sampai kekuningan pada saat masak, berasa sangat masam ketika muda, tetapi menjadi manis ketika sudah masak. Di Indonesia, tanaman ini berbunga pada bulan September dan Oktober, dan buah akan matang pada bulan Februari dan Maret.', 'Air : 90-95 g.\r\nKarbihidrat : 6,3 g.\r\nLemak : 0,8 g.\r\nProtein : 0,7 g.\r\nKalsium : 37-120 mg.\r\nFosfor : 22-40 mg.\r\nBesi : 0,7 mg.\r\nVitamin C : 8 mg. \r\nVitamin A : 10 IU. \r\nNilai energi : 1344 KJ/100 G. ', 'Memperlancar saluran pencernaan.\r\nMengobati penyakit sifilis.\r\nMenjaga kekebalan tubuh.\r\nMencegah kolesterol.', 'Kingdom	: Plantae .\r\nKelas		: Magnoliopsida .\r\nOrdo		: Phyllanthaceae.\r\nFamilia	: Amtidesmeae.\r\nGenus		: Antidesma.\r\nSpesies	: Antidesma bunius (L.).\r\n', '', NULL, '2019-10-02 21:12:30', '2019-10-02 03:35:02', 1, 1),
('2019-10-02-5d941b819c8ac', 'buah', 'Buah Jambu Air ', 'Buah Jambu Air (Eugenia aquea)', 'Jambu air berasal dari daerah Cina & Indonesia, tersebar ke Malaysia & pulau-pulau\r\ndi Pasifik.\r\nBuah tanaman jambu berbentuk lonceng, kerucut atau berbentuk membulat keatas berwarna hijau ketika masih mudah dan berwarna kemerahan ketika sudah tua/matang. Biji tanaman jambu air berbentuk seperti ginjal berwarna putih hingga coklat dengan berdiameter 1-1,5 cm, dan memiliki selaput berwarna putih.', 'kilojoule : 192  kj\r\nkalori : 46 kkal.\r\nlemak : 0,27 g.\r\nprotein : 0,5 g.\r\nkarbohidrat 11,66 g.\r\nkalium : 126 mg.', 'Mengontrol diabetes.\r\nMengatasi diare dan kembung.\r\nMenurunkan kadar kolesterol.\r\nMelawan infeksi jamur.', 'Kingdom	: Plantae (Tumbuhan).\r\nSubkingdom	: Tracheobionta (Tumbuhan berpembuluh).\r\nSuper Divisi	: Spermatophyta (Menghasilkan biji).\r\nDivisi		: Magnoliophyta (Tumbuhan berbunga).\r\nKelas		: Magnoliopsida (berkeping dua / dikotil).\r\nSub Kelas	: Rosidae.\r\nOrdo		: Myrtales.\r\nFamili		: Myrtaceae (suku jambu-jambuan).\r\nGenus		: Eugenia.\r\nSpesies	: Eugenia aquea Burm.F (Sumber: www.petanihebat.com).\r\n', '', NULL, '2019-10-03 10:30:01', '2019-10-02 03:37:37', 1, 1),
('2019-10-02-5d94bc0ec0e59', 'buah', 'Buah Matoa', 'Buah Matoa (Pometia pinnata) ', 'Matoa tumbuh tersebar mulai dari Sri Lanka dan Kepulauan Andaman melalui\r\nAsia Tenggara, sampai Fiji dan Samoa. Matoa juga terdapat di beberapa daerah di Sulawesi,\r\nMaluku, Jawa, Kalimantan. Matoa merupakan jenis tanaman buah yang memiliki karakter serupa dengan tanaman\r\nrambutan. Pohonnya memiliki ketinggian rata-rata 18 meter dengan diameter 100 cm, namun\r\nmemiliki daun yang lebih besar daripada daun rambutan. Buah matoa memiliki bentuk\r\nlonjong seperti buah sawo yang berwarna merah keunguan dengan sedikit warna hijau ketika\r\nsudah matang', 'kilojoule : 29  kj\r\nkalori : 7 kkal.\r\nlemak : 0,02 g.\r\nprotein : 0,06 g.\r\nkarbohidrat : 1,79 g.\r\nsodium : 1 mg.\r\nkalium : 4 mg.', 'Buah matoa dapat meningkatkan daya tahan tubuh. \r\nMembantu Mengurangi Stres\r\nyang Anda Alami karena dalam buah matoa terkandung zat yang dapat berfungsi sebagai\r\nobat penenang. \r\nMengurangi Risiko Kanker. buah matoa mengandung antioksidan yang dapat\r\nmencegah pertumbuhan sel-sel kanker yang disebabkan karena radikal bebas.\r\nMembantu\r\nMengurangi Risiko Jantung.\r\nmenjaga Kesehatan Kulit. \r\nSebagai Sumber Energi Alternatif.\r\nmelancarkan penceranaan.', 'Kingdom : Plantae. \r\nDivisi  : Magnoliophyta. \r\nKelas  : Magnoliopsida. \r\nOrdo  : Sapindales. \r\nFamili  : Sapindaceae. \r\nGenus  : Pometia. \r\nSpesies : Pometia pinnata.', '', NULL, '2019-10-03 10:32:22', '2019-10-02 15:02:38', 1, 1);
